insert into tblNotice values (notice_seq.nextval, 1, 1, '당 교육센터에서는 지식경제부와 한국정보통신산업진흥원주관으로 취업연계교육센터에 입소할 교육생을 아래와 같이 모집합니다. 교육기간 : 기본교육(10일) + 기업맞춤형교육(3개월) 교육일정 : 총 3.5개월 매주 월~금(09:00~18:00) 교육장소 : 강남교육센터 교육대상 : 이공계 학사학위 취득자 및 졸업예정자(졸업후 2년이내인자) 교육비용 : 국비전액지원(교육비 및 교재비 전액지원) 교육생특전 : 기업 맞춤형 교육후 전원취업예정', to_date('2022-12-20', 'yyyy-mm-dd'), 20);
insert into tblNotice values (notice_seq.nextval, 1, 2, '안녕하세요. 쌍용교육센터입니다. 쌍용교육센터 취업교육 수강을 위해서는 내일배움카드(구직자)를 발급 받아야 합니다. 작년 8월부터 한정된 예산으로 인해 훈련이 필요한 사람을 선별·지원하기 위해 훈련상담 강화를 통한 계좌발급인원 사전배정제가 시행되었습니다. 이 제도가 23년 말까지속 운영됩니다. 이로 인해 카드발급 기간이 4주~최대 6주까지 소요 되는 등 예상 일정에서 크게 벗어나는 변수가 발생하고 있습니다. 우리 교육센터 취업교육 수강을 원하는 분들은 교육 참여에 차질이 없도록 한 달 이상의 충분한 시간적 여유를 가지고 준비하여 주시기 바랍니다.', to_date('2023-02-10', 'yyyy-mm-dd'), 21);
insert into tblNotice values (notice_seq.nextval, 1, 3, '안녕하세요. 쌍용교육센터입니다. 4~5월 휴무일 안내입니다. 4/30(목) 부처님오신날, 5/1(금) 근로자의날, 5/4(월) 휴일, 5/5(화) 어린이날전화상담과 카카오톡상담은 정상적으로 운영하오니 문의바랍니다.기타 문의사항은 02-3482-4632~5로 연락 바랍니다. 감사합니다.', to_date('2023-03-30', 'yyyy-mm-dd'), 22);
insert into tblNotice values (notice_seq.nextval, 2, 4, '현재 정규과정인 재직자과정은 모집이 종료되어 2월6일에 개강을 하여 실시중에 있습니다. 홈페이지에 에러가 발생해서 본의아니게 화면상으로는 교육과정명을 계속 보여주고 있습니다. 빠른 시간에 수정해서 사용하시는데 불편함이 없도록 하겠습니다. 감사합니다.', to_date('2023-02-28', 'yyyy-mm-dd'), 23);
insert into tblNotice values (notice_seq.nextval, 2, 5, '안녕하세요. 쌍용교육센터입니다. 4~5월 휴무일 안내입니다. 4/30(목) 부처님오신날, 5/1(금) 근로자의날, 5/4(월) 휴일, 5/5(화) 어린이날전화상담과 카카오톡상담은 정상적으로 운영하오니 문의바랍니다. 기타 문의사항은 02-3482-4632~5로 연락 바랍니다. 감사합니다.', to_date('2023-03-30', 'yyyy-mm-dd'), 24);
insert into tblNotice values (notice_seq.nextval, 2, 1, '쌍용교육센터에서 진행되는 재직자(사업주 위탁) 훈련과정은 QR코드 기반 출결관리 시스템으로 진행됩니다. 고용노동부 재직자(사업주 위탁)훈련에 참여하는 수강생은 출결에 따른 불이익이 발생하지 않도록 개강 전 [고용노동부 HRD-Net] 어플을 다운로드 부탁드립니다. ※ 기존 [HRD-Net출결관리] 어플은 서비스 종료 ', to_date('2023-04-30', 'yyyy-mm-dd'), 25);
insert into tblNotice values (notice_seq.nextval, 3, 2, '현재 쌍용교육센터에서는 이공계전문기술연수교육생을 모집중에 있습니다. 교육비는 무료이며 교육기간동안 교육수당이 최대 220만원 지급됩니다. 또한 쌍용강북교육센터에서는 100% 정부지원과정인 국가기간전략산업직종훈련을 모집중에 있습니다. 이미 6개과정은 성황리에 선발이 완료되었으며 현재 5월6일 개강반을 모집중에 있습니다. 교육기간은 5.5개월이며 교육비는 무료이고 교육받을시 교육수당이 매월 최대 316,000원씩 지급이 됩니다. 감사합니다.', to_date('2023-02-28', 'yyyy-mm-dd'), 26);
insert into tblNotice values (notice_seq.nextval, 3, 3, '안녕하세요. 쌍용교육센터입니다. 4~5월 휴무일 안내입니다. 4/30(목) 부처님오신날, 5/1(금) 근로자의날, 5/4(월) 휴일, 5/5(화) 어린이날전화상담과 카카오톡상담은 정상적으로 운영하오니 문의바랍니다. 기타 문의사항은 02-3482-4632~5로 연락 바랍니다. 감사합니다.', to_date('2023-03-28', 'yyyy-mm-dd'), 27);
insert into tblNotice values (notice_seq.nextval, 3, 4, '쌍용교육센터 휴무 안내안녕하세요. 쌍용교육센터입니다.쌍용교육센터 휴무일 안내드립니다.2023년 4월 29일(토) ~ 2023년 5월 1일(월)위의 휴무 기간에도 전화 상담과 카카오톡 상담은 정상적으로 운영하오니 문의 바랍니다. [강남] 02-3482-4632~5 [강북] 02-336-8546~8감사합니다.', to_date('2023-04-20', 'yyyy-mm-dd'), 28);
insert into tblNotice values (notice_seq.nextval, 4, 5, '당 교육센터에서는 고용노동부와 한국산업인력공단 주관으로 국가기간전략산업직종훈련 교육생을 아래와 같이 모집합니다. 교육기간 : 2013.07.29~2014.02.04(신촌교육센터) 교육일정 : 총 5.5~6개월 매주 월~금(09:00~18:00) 교육대상 : 미취업자/졸업예정자 교육비용 : 국비전액지원(교육비 및 교재비 전액지원) 훈련수당 : 최대 월 316,000원 지급', to_date('2023-08-07', 'yyyy-mm-dd'), 29);
insert into tblNotice values (notice_seq.nextval, 4, 1, '안녕하세요. 쌍용교육센터입니다. 추석 휴무일 안내입니다. 2023년 9월 9일(금) ~ 9월 12일(월)위의 추석 연휴 기간에도 전화 상담과 카카오톡 상담은 정상적으로 운영하오니 문의 바랍니다.', to_date('2023-09-01', 'yyyy-mm-dd'), 30);
insert into tblNotice values (notice_seq.nextval, 4, 3, '안녕하세요. 쌍용교육센터입니다. 2023년도 2차 재직자 직업능력개발훈련 교육과정 안내입니다. 코로나19 확산에 따라 잠정적으로 연기되었던 재직자 교육과정을 오는 11월 14일(토) 개강합니다. 강의 일정은 매주 토요일 09:00~17:00  5일 35시간 진행되며 주말을 이용해 업무에 필요한 스킬을 배양하실 수 있는 좋은 기회가 될 것입니다. 감염 확산에 대비하기 위해 비대면 훈련을 원칙으로 하되 출석을 원하는 분에 한해 집체훈련과 병행하여 진행할 예정입니다. (모집인원에따라 변동 가능)근로자의 직무능력향상을 위하여 사업주(또는 교육담당자) 분들의 적극적인 관심과 신청 부탁드립니다.※ 과정에 대한 상세한 정보는 [재직자과정]에서 확인바랍니다.', to_date('2023-11-03', 'yyyy-mm-dd'), 10);
insert into tblNotice values (notice_seq.nextval, 5, 2, '안녕하세요. 쌍용교육센터입니다. 2023년도 1차 재직자 직업능력개발훈련 교육과정 안내입니다. 코로나19 확산에 따라 잠정적으로 연기되었던 재직자 교육과정을 오는 7월 13일 개강합니다.강의 일정은 매주 토요일 09:00~17:00  5일 35시간 진행되며 주말을 이용해 업무에 필요한 스킬을 배양하실 수 있는 좋은 기회가 될 것입니다. 감염 확산에 대비하기 위해 비대면 훈련을 원칙으로 하되 출석을 원하는 분에 한해 집체훈련과 병행하여 진행할 예정입니다. (모집인원에따라 변동 가능)근로자의 직무능력향상을 위하여 사업주(또는 교육담당자) 분들의 적극적인 관심과 신청 부탁드립니다.※ 과정에 대한 상세한 정보는 [재직자과정]에서 확인바랍니다.', to_date('2023-07-13', 'yyyy-mm-dd'), 15);
insert into tblNotice values (notice_seq.nextval, 5, 4, '안녕하세요 쌍용교육센터입니다. 코로나19에 대응하여 올해 종료되는 과정부터 한시적으로 특별 훈련수당이 지급됩니다. 지원대상이 확대되었고, 지원금액도 상향 조정 되었네요.자세한 사항은 02-3482-4632~5로 연락바랍니다. 감사합니다.', to_date('2023-08-27', 'yyyy-mm-dd'), 30);
insert into tblNotice values (notice_seq.nextval, 5, 5, '안녕하세요. 쌍용교육센터입니다. 추석 휴무일 안내입니다. 2023년 9월 9일(금) ~ 9월 12일(월)위의 추석 연휴 기간에도 전화 상담과 카카오톡 상담은 정상적으로 운영하오니 문의 바랍니다.', to_date('2023-09-01', 'yyyy-mm-dd'), 22);
insert into tblNotice values (notice_seq.nextval, 6, 1, '안녕하세요. 쌍용교육센터입니다. 6월 휴무일 안내입니다. 6/6(목) 현충일, 6/7(금) 휴일 전화상담과 카카오톡상담은 정상적으로 운영하오니 문의바랍니다.덧붙여 6/8(토) 주말 재직자 과정은 수업이 없는 날이오니 유의 바랍니다.기타 문의사항은 02-3482-4632~5로 연락 바랍니다. 감사합니다.', to_date('2023-05-31', 'yyyy-mm-dd'), 25);
insert into tblNotice values (notice_seq.nextval, 6, 2, '안녕하세요? 쌍용교육센터입니다. 오는 2023년 6월22일에 개강하는 재직자 직업능력개발훈련 교육과정 안내입니다. 주말을 이용하여 업무능력향상에 도움이 되는 기회가 되시길 바라겠습니다. 또한 쌍용강북교육센터만의 특별 이벤트로 강의신청과 수요조사 모두 참여해주신 분들께 스타벅스 기프티콘을 100% 증정해드리고 있습니다 재직자, 사업주 분들의 많은 관심과 참여 부탁드립니다.', to_date('2023-06-20', 'yyyy-mm-dd'), 10);
insert into tblNotice values (notice_seq.nextval, 6, 3, '현재 쌍용교육센터에서는 이공계전문기술연수교육생을 모집중에 있습니다. 교육비는 무료이며 교육기간동안 교육수당이 최대 220만원 지급됩니다. 또한 쌍용강북교육센터에서는 100% 정부지원과정인 국가기간전략산업직종훈련을 모집중에 있습니다. 이미 6개과정은 성황리에 선발이 완료되었으며 현재 5월6일 개강반을 모집중에 있습니다. 교육기간은 5.5개월이며 교육비는 무료이고 교육받을시 교육수당이 매월 최대 316,000원씩 지급이 됩니다. 감사합니다.', to_date('2023-07-25', 'yyyy-mm-dd'), 45);
insert into tblNotice values (notice_seq.nextval, 7, 4, '근로자 직업능력개발훈련 지원 규정이 2023년 01월 01일 부로 개정되었습니다. 집체훈련과정 자부담 40% 직종확대와 동일 과정 반복수강 및 연간 수강 횟수제한에 대한 내용입니다.우리 교육센터는 자부담액 인상 없이 우선지원대상기업근로자로 근로자 카드를 발급받은 경우 현행유지(전액지원) 됩니다. 꼼꼼히 확인하시고 추후 교육과정 신청시 혼란이 없길 바랍니다. 감사합니다.', to_date('2023-06-22', 'yyyy-mm-dd'), 5);
insert into tblNotice values (notice_seq.nextval, 7, 5, '안녕하세요. 쌍용교육센터입니다. 쌍용교육센터 취업교육 수강을 위해서는 내일배움카드(구직자)를 발급 받아야 합니다. 작년 8월부터 한정된 예산으로 인해 훈련이 필요한 사람을 선별·지원하기 위해 훈련상담 강화를 통한 계좌발급인원 사전배정제가 시행되었습니다. 이 제도가 19년 말까지 지속 운영됩니다. 이로 인해 카드발급 기간이 4주~최대 6주까지 소요 되는 등 예상 일정에서 크게 벗어나는 변수가 발생하고 있습니다. 우리 교육센터 취업교육 수강을 원하는 분들은 교육 참여에 차질이 없도록 한 달 이상의 충분한 시간적 여유를 가지고 준비하여 주시기 바랍니다.', to_date('2023-06-30', 'yyyy-mm-dd'), 26);
insert into tblNotice values (notice_seq.nextval, 7, 1, '안녕하세요. 쌍용교육센터입니다. 코로나19 대응 국민내일배움카드 추가지원 지침 안내드립니다. 8월 개강하는 주말 재직자 교육과정도 자부담 완화 적용을 받아[변경전] 103,770원 [변경후] 69,180원 으로 자부담액이 조정 되었습니다. 자세한 문의는 02-3482-4632로 연락 바랍니다. 감사합니다.', to_date('2023-10-05', 'yyyy-mm-dd'), 15);
