insert into tblReview values (review_seq.nextval, 1, '매우매우 만족합니다. 팀장님께서도 처음 면접 봐주실 때 진로에 대해서도 자세하게 소개해 주시고 강사님께서도 수업 때 항상 열정적으로 가르쳐 주셨습니다. 매 시간마다 따라오지 못하는 학생이 있으면 수업에 방해되지 않는 선에서 계속 도와주시고 수업시간 외적으로도 계속 도와주셨습니다.질문사항에 대해서도 주말에도 계속 받으셔서 수업 때 답변해주셨습니다. 정말 좋은 팀장님과 강사님을 만나서 무사히 잘 수료하게 되었습니다.', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 2, '선생님께서 비전공자도 쉽게 이해할 수 있게 강의해주셨으며 수강생에게 애정을 가지고 계신게 느껴졌습니다. 매니저님께서도 수강생을 꼼꼼하게 챙겨주셔서 좋았습니다.', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 3, '굉장히 열정적으로 강의해주신 강사님 덕분에 개발자로서의 시작을 더욱 수월하게 할 수 있을 것 같습니다. 업무적으로 학생들을 대하는 게 아니라 관심가지고 애정을 주시며 가르쳐주셔서 너무 감사하게 생각하고 있습니다.말썽쟁이반 강의하시느라 고생 많으셨습니다. 건강하시고 감사해요!!!매니저님도 여러모로 서포트해주시느라 고생 많으셨습니다. 감사합니다!!!', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 4, '박세인 강사님에 대해 평소 굉장히 후기가 좋았기 때문에 기대하고 교육에 참여하게 되었습니다. 왜 다들 칭찬과 소문이 자자했는지 단번에 알 수 있었습니다. 뒤쳐지는 학생들을 어떻게든 알려주고 이끌어주려고 노력해주시고 현실적인 조언과 함께 격려해주시는 모습에 지난 5.5개월간 너무 유익하게 공부할 수 있었습니다. 장혜진 매니저님도 늘 학생들에게 공감해주시고 좋은 말씀 많이 해주셔서 큰 도움이 되었습니다. 주변에 개발자 국비교육과정을 생각중인 지인이 있다면 적극 추천하겠습니다!', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 5, '단지 취업을 위한 목적으로 다니게 된 학원이라 큰 기대를 하지 않았습니다. 하지만 직접적으로 수업을 해주신 강사님과 취업관련 도움을 주신 팀장님을 비롯한 쌍용 교육센터의 모든 관계자 분들이 너무 신경을 많이 써주시고 열정적으로 도움을 주려고 하셔서 반년동안 얻어가는게 정말 많습니다. 모든게 다 너무 만족스럽습니다. 비전공자라 코딩에 대해 아무것도 몰랐기에 막연했었지만 (이창익)강사님이 잘 가르쳐주셨고 주말과 퇴근하시고 난 후에도 질문을 다 받아주시고 알려주실 만큼 학생들에게 최선을 다해주시는 최고의 스승님이셨습니다! 6개월이 너무 짧게 느껴질 정도로 좋은 인연을 많이 알게 되었고 취업에 대한 자신감도 생기게 되어 다시 이 훈련과정을 듣고 싶을 정도로 의미있는 시간들이었습니다!', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 6, '과정에서 설명 되어있듯이 자바 기초부터 클라우드까지 다양한 기술 스택을 단기간에 배울 수 있는 5.5개월 이었습니다. 30명을 모두 케어하기에 힘드실 법도 한데 새로운 걸 시작할 때마다 막히는 부분이 있는지 한 사람 한 사람 챙겨주셔서 더 감사한 시간이었습니다. 다른 개발을 준비하는 친구에게 벌써 추천하였습니다ㅎㅎ', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 8, '실력있고 성품 좋으신 강사님께 6개월간 좋은 강의 해주셔서 감사합니다. 또한 매니저님께서도 훈련 외적으로 많은 도움 주셔서 감사했습니다. 해당 훈련과정을 이수하기 전과는 많이 차이나는 모습으로 수료 할 수 있게 된것 같아서 안심이 됩니다. 이론을 철저히 알려주시고 이후 실습을 통해 배운 이론을 자기 것으로 만드는 방식 또한 너무 좋았습니다. 6개월동안 감사했고 다른 지인이 학원을 알아본다고 한다면 당연코 쌍용교육센터를 추천 할 생각입니다.', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 9, '의지만 있다면 얻어갈 것이 많은 훈련', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 10, '저는 수강전에 아주 초보자 수준이라서 윤선영 강사님께 기초적인 질문을 많이 했었는데 꼼꼼하고 친절하게 잘 알려줬습니다. 덕분에 아주 초보였던 저도 수업 잘 따라갈 수 있었습니다. 이 외에도 강사님께서 학생들을 정말 많이 배려해주셨고 약 7개월동안 잘 배울 수 있었습니다. 그리고 쌍용교육센터의 직원분들도 정말 친절하고 특히 하루 강의가 다 끝나고 2층에서 지문을 찍어야 하는데 항상 직원 한분이 옆에서 집에가는 학생 한명한명에게 인사를 해주었어요. 사소한 부분일 수 도 있지만 8시간 수업을 듣고 지쳐있을때 그런 인사가 응원같아서 힘이 날 때도 있었습니다. 그리고 강의실과 휴게실도 항상 깨끗해요.', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 11, '쌍용 교육센터 김용만 강사님께 수업 받았습니다. 저는 기초도 아예 없는 비전공자라서 전공했던 학생들과 같이 수업을 듣는게 조금 걱정스러웠는데 강사님께서 기초 지식부터 하나하나 알아듣기 쉽게 설명해 주셔서 마지막까지 따라갈 수 있었습니다! 에러가 나거나 수업을 따라가지 못하는 학생이 있으면 따라올 수 있게 한 학생 한 학생 끝까지 지도해주셔서 너무 감사했습니다! 강사님 덕분에 자신감을 갖고 취업활동을 할 수 있게 되었습니다.', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 12, '처음 학원을 알아보기 시작했을 때는 코딩의 키읔자도 모르는 문외한이었습니다. 하지만 지난 7개월 동안 선생님이 잘 가르쳐주신 덕분에 여러 프로젝트를 완성시킬 수 있을 만큼 많이 배우고 성장할 수 있었습니다. 최근 현장에서 많이 사용한다는 프로그램들도 선생님께서 빼놓지 않고 다 가르쳐주셔서 좋았습니다. 학원에서 배운 내용들을 밑거름 삼아 취업한 이후로 더 성장하고 발전시킬 수 있도록 노력할 예정입니다. 학원의 경우 중간에 컴퓨터 장비도 업그레이드 해주어 좀 더 편하게 수업을 들을 수 있었습니다. 그리고 각 층마다 배치된 회의실 공간 덕분에 3차에 걸친 프로젝트를 진행할 때 좀 더 수월하게 진행할 수 있었습니다. 회의실마다 화이트보드가 있어 잘 활용하였습니다. 또한 방과 후까지 강의실과 회의실을 개방해주셔서 과제를 하거나 프로젝트를 마무리 하는데 큰 도움이 되었습니다. 과정이 끝나갈 무렵부터 매니저님과 선생님과의 면담을 통해 취업에 대한 정보를 제공 받을 수 있었습니다. 앞으로 6개월 동안 학원의 도움을 받아 최대한 빠르게 취업할 수 있도록 열심히 노력할 생각입니다. 좋은 기회를 얻을 수 있어서 감사한 마음 뿐입니다. 정말 감사합니다.', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 13, '처음으로 받는 국비 훈련이라 내가 잘할 수 있을지 나한테 많은 도움을 줄지 고민도 했지만 수업받으면서 열정적으로 가르쳐주신 박세인 강사님과 학원 덕분에 성장을 할 수 있었다. 수업은 그냥 코드만 보여주고 복사해 붙여넣는 형식이 아니라 원리를 설명해주시고 요즘 자주 쓰는 방식 예전 방식 등등 여러 가지를 골고루 설명을 해주셔서 다양하게 배울 수 있었다. 수업이 끝난 후에는 프로젝트를 하는데 자신의 부족한 실력 때문에 걱정이 많았지만 팀원들과 강사님한테 도움을 받으면서 무사히 끝내고 성취감을 느낄 수 있었다. 과정이 끝난 이후에도 이력서와 포트폴리오 채용 정보 등 매니저님과 강사님한테 관리받을 수 있다는 것도 큰 장점이라 생각한다. 자신이 개발자가 되고 싶지만 너무 어렵거나 혼자 하기 힘들다면 해당 훈련과정을 수강하는 것도 좋은 방법이라 생각한다 물론 아무것도 안 하고 대충 수업 출석만 한다고 개발자가 되는 건 아니다', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 14, '제 인생에서 이수연 강사님을 만난 것이 신의 한 수였습니다. 이수연 강사님께서 수업을 따라가기 쉽게 꼼꼼히 재미있게 이끌어주셨습니다. 5.5개월이라는 짧지 않은 시간 동안 강사님의 지치지 않는 열정 덕분에 매 수업을 흥미롭고 유익하게 들을 수 있었습니다! 프로젝트 기간에도 각 팀마다 어려움은 없는지 지속적으로 체크해주시는 모습이 감사했습니다. 쌍용교육센터에서의 교육을 기반으로 추후 어느 곳에 취업되어도 잘할 수 있다는 자신감이 생겼습니다.', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 15, '저는 운이 좋게도 [훌륭하신 강사님 + 훌륭하신 매니저님 + 열정적이면서도 쾌활한 원생들] 이 삼박자가 고루 갖추어진 분위기 아래서 훈련을 받았습니다. 빡세다고 말할 수 있는 커리큘럼임에도 불구하고 곽우신강사님께서 설명을 굉장히 잘해주시고 재미있기까지 하셔서 수업 듣는 게 너무너무너무 즐거웠습니다. 모르는 부분을 질문드렸을 때에도 열정적으로 가르쳐주시는 강사님 덕분에 저 또한 열정이 더더욱 불타올라 열심히 할 수 있었습니다! 강사님 진짜 최고예요!! (격려도 잘해주십니다) 장혜진 매니저님께서도 자소서 및 포트폴리오 첨삭 그리고 상담도 친절히 그리고 적극적으로 잘 해주십니다! 제가 안고 있던 고민도 먼저 물어봐 주시고 정말 감사했습니다 ㅠㅠ! 어쨌든 결과적으로 100% 만족스러운 훈련과정이었습니다! 훈련과정 안에서 배웠던 모든 것들은 앞으로 제가 살아가는 데 있어 많은 도움이 될 것 같습니다! 다시 한번 감사드립니다!', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 16, '전공자로써 학부에서 배우지못한 기술들을 배울수 있었습니다. 기초부터 배우기때문에 비전공자들도 쉽게 따라와서 대부분이 무사히 수료하고 취업까지 할 수 있습니다. 긴 시간동안 고생하신 강사님과 매니저님 감사드립니다.', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 17, '김*만 강사님께 강의를 듣게 되었는데 모르는 것이 있으면 시간과 상관없이 정말 친절하게 봐주셨습니다. 강사님의 강의를 듣게 된 것이 정말 큰 행운이라 생각합니다. 좋은 말도 많이 해주시고 실질적으로 도움이 되는 공부 방법도 알려주셔서 정말 감사했습니다! 학원도 취업관련 문의를 친절하게 받아주시고 알아봐주시려 합니다. 취업에 고민이 있는 비전공자분이나 전공자임에도 실력이나 포트폴리오가 빈약하다 느끼는 분들은 고민말고 지원하셨으면 합니다. 좋은 개발자 동료들과 좋은 프로젝트 경험을 하며 인연도 쌓게 되어 정말 좋게 생각합니다. 좋은 경험이 됐습니다!', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 18, '비전공자로 시작해서 학원선택부터 불안과 걱정이 많았지만 5.5개월간 배우면서 개발전반에 대해 기초적인 지식을 쌓을 수 있었습니다! 박세인 선생님 엄청 친절하시고 설명도 코드작성에서 끝나지않고 원리까지 설명해주셔서 도움이 많이 됐어요ㅎㅎ다른 분이 듣게된다면 꼭 추천해주고 싶습니다! 그리고 장혜진 매니저님도 친절하시고 도움많이 주셔서 감사했습니다굉장히 빠듯한 시간이지만 잘짜여진 커리큘럼으로 인해 다양한 기술들을 알차게 배울 
insert into tblReview values (review_seq.nextval, 19, '이수연 강사님이었고 친절하셨습니다 코로나 상황으로 인해 대면을 일주일에 2번 진행했는데 그 점이 아쉬웠습니다. 비대면 훈련임에도 훈련생들에 대한 지속적인 관심과 배려가 너무 좋았습니다. 강사님도 친절하시고 매니저님도 학생들을 위해주셔서 감동 받았습니다', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 20, '강사님과 매니저님이 무척 친절하시고 열정이 가득하시다. 직접 만드신 자료로 학생들의 이해를 도와주셨고 수업시간 내내 부족하면 쉬는시간이나 휴일까지도 잘못된 점 어려운 점 등을 고쳐주고 알려주셨다. 일상에서 접하는 과목이 아닌 만큼 어려운 내용이지만 본인이 충분히 개발하는 것을 좋아하고 그만큼 노력한다면 좋은 결과를 얻을 수 있을 것이라고 생각한다. 충분히 알아보고 나서 이 길로 갈 결심을 했다면 추천하고 싶은 수업이다. 함께해주신 강사님 매니저님 수강생 분들께 감사하다. 강사님 매니저님 모두 정말 좋았습니다. 낙오자 한명없고 수업을 하나하나 쌓아서 가르쳐주셔서 감사했습니다. 어떤 질문을 해도 주저없이 답해주실 수 있는 능력과 수업 시간외 수업을 준비해주시는 철저함과 열정이 존경스러웠습니다. 어떤 학원을 가더라도 한장희 강사님만큼의 강의는 못 들을 것 같다는 확신이 듭니다. 5.5개월이 쉬운 기간은 아니었지만 후회되지 않는 기간입니다. 매니저님도 자소서 첨삭 능력이 대단하고 정말정말 친절하십니다!!! 5.5개월동안 감사했습니다~! 학교에서 배운 것보다 더 깊고 회사생활에 더 중점적인 부분을 배울 수 있어서 매우 유익한 강의였습니다. 웹 프로그래밍에 대한 기초가 거의 없었기 때문에 수강을 하였고 수료한 지금 처음에 기대했던 것보다 더 많은 지식을 얻을 수 있어서 좋았습니다. 강사님 매니저님 두 분 모두 수강생들의 취업에 있어 적극적인 태도를 보여주시고 믿음직스럽게 조언해주시고 계셔서 취업을 준비하는데 있어서 도움이 많이 되고 있습니다!', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 21, '꼼꼼한 강의로 비전공자도 잘 따라올 수 있는 환경을 마련해주셨습니다. 한명한명의 수강생들을 챙기셨고 뒤쳐지는 사람이 없도록 노력하시는 모습이 대부분의 사람들이 중도포기하지 않고 끝까지 갈 수 있었던 이유인 것 같습니다. 개발자 양성 과정으로 정말 최고입니다. 김호진 선생님을 만나서 정말 다행이었고 지난 6개월 정말 보람차게 개발자의 출발을 잘 한 것 같다고 생각이 듭니다! 선생님이랑 매니저님 모두 감사드립니다!!! 프로그래밍에 대한 지식이 전무해서 많은 걱정을 가지고 시작했었는데 강사님이 기초부터 심화까지 차근차근 알려주셔서 많이 배우고 성장할 수 있던 기간이었습니다.', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 22, '대면이라 아쉬운 부분이 있었지만 비대면임에도 불구하고 강사님께서 친절하게 설명해주셔서 좋았습니다! 모르는 것도 질문하면 강사님께서 답변잘해주시고 에러도 원격으로 잡아주셔서 수업하는데 지장이 없었습니다! 매니저님도 친절하게 대해주시고 수강하는 기간동안 재밌고 열정적으로 듣다가 수료합니다! 수강하고자 했던 수업내용대로 배울 수 있어 만족했고 강사님께서 질문 답변을 깊이 있게 해주셨고 매니저님은 취업 관련 정보들을 다양하게 제공 해주어 만족스럽게 수강을 마무리 할 수 있었다. 준비가 하나도 되어있지 않은 상태였던 저는 수업을 듣기에는 솔직히 많이 버거웠던것 같습니다. 짧은 시간내에 전체적인걸 배워야 하기에 쉬운괴정은 절때 아니라고 생각하지만 분명 도움이 되는 수업이라고 생각합니다.', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 23, '선생님 진짜 너무 좋으시고 교육과정자체가 탄탄하고 자세해서 좋은거같아요. 자세하게 잘 알려주셔서 좋습니다. 이 기회로 충분히 테스트하고 너무 자세하게 잘 배운것 같아서 좋아요. 후회없는 6개월 이었습니다. 우신 선생님 최고에요. 곽우신 강사님께 6개월동안 훈련과정을 수강 했고 굉장히 만족스러웠습니다. 현직에서 일하셨던 강사님이셔서 현장감각도 익힐 수 있었고 어려운 내용임에도 쉽게 풀어서 설명해주시고 매일 복습해주셔서 수업 진도를 따라가는데 크게 어려움이 없었습니다. 질문할 때도 굉장히 친절하게 알려주셔서 비대면 수업이지만 큰 불편함 없이 잘 마무리 할 수 있었습니다. 학생들을 오래 가르치셔서 어느 부분을 학생들이 어려워 하는지 알고 계신 것 같다는 느낌을 받았습니다. 선생님 수업은 기승전결이 있고 정말 잘 가르치신다는 느낌을 받았어요. Java Spring을 익히는데 많은 도움을 받았습니다. 선생님 뿐 만 아니라 장혜진 매니저님도 정말 친절하셨고 건의사항이나 문제 상황이 발생했을 때 빠르고 적극적으로 대응해주셔서 굉장히 좋았습니다. 감사한 6개월이었습니다.', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 24, '비전공자이고 비대면으로 수업했음에도 불구하고 강사님께서 기초부터 차근 차근 잘 알려주시고 이해 안가는 부분 질문하면 잘 설명해주셔서 따라가는데 문제 없었습니다. 6개월동안 성심성의껏 꼼꼼히 친절하게 가르쳐주신 강사님께 감사드리고 여러모로 신경 많이 써주시고 지금도 신경써주시는 매니저님께도 정말 감사드립니다. 첫걸음을 좋은 강사님 좋은 매니저님과 함께해서 참 다행이라는 생각이 듭니다^^ 강사님 설명도 잘해주시고 수업시간 도중에도 질문시간을 주시기 때문에 모르는게 있으면 꼭 물어보시는걸 추천드립니다 배울 내용이 많기 때문에 Java를 선행하고 오시면 다른 과목을 공부하기 훨씬 수월합니다 프로젝트는 중간 1번 마지막 1번해서 총 2번 진행합니다 대부분이 windows를 사용해서 다른 os에서 발생하는 문제는 본인이 해결해야 됩니다 os가 달라서 해결하는 오류찾는게 생각보다 시간이 많이 소모되기 때문에 개인적으로 windows 노트북으로 수업듣는걸 권장합니다 학원에도 데스크탑이 있지만 언제 비대면으로 전환될지는 아무도 모르고 다른사람도 쓸 수 있기 때문에 자신이 설정해놓은 git이나 ide 설정이 바뀔 수 있기 때문입니다 수업 중간에 대면수업을 하다가 코로나 때문에 비대면으로 진행된게 아쉬웠습니다 전반적으로 수업 만족도가 높았습니다 강사님과 매니저님 6개월 동안 감사했습니다.', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 25, '1. 선생님의 강의와 학원의 환경은 더없이 좋았어서 실력상승의 요소는 스스로의 노력밖에 떠오르지 않았습니다. 2. 전체적인 과정은 훈련생들이 현업에 나가 자주 사용하는 부분에 대해 기초부터 차근차근 알려주시며 모두가 이해할 수 있도록 쉽게 말씀해주십니다. 모른다고 질문을 드려도 정말 친절하게 알려주시니 필요하다면 꼭 질문을 하시면 좋겠습니다(저는 잘 못했어서 아쉬웠습니다). 3. 선생님께 배운 교육내용을 기반으로 2번의 프로젝트를 진행했는데 열심히 한다는 전제하에 프로젝트를 할 때마다 실력이 스스로 늘었다 할 정도로 본인의 실력상승에 도움이 되니 꼭 열심히 참여하시기 바랍니다(애초에 본인 포트폴리오를 위해서도 권장드립니다). 4. 훈련기간동안 도움을 주신 강태림 매니저님 최고의 교육을 해주신 서영학 선생님 끝까지 수료한 우리반 분들 모두 수고하셨고 정말 감사드립니다! 강사님의 수업을 들으면서 개발 직무를 접하게 되었고 이론 수업을 바탕으로 프로젝트를 진행하면서 지식을 습득하는 과정이 재미있게 느껴졌습니다. 강사님께서 항상 학생들을 위해 열정적으로 강의해주시고 질문이 있다면 꼼꼼하게 답변해주시며 적극적으로 소통해주시기 위해 최선을 다해주셨습니다. 서영학 강사님이 아니었다면 이 시간까지 오는데 힘들었을 것 같습니다. 힘들어할 때마다 응원과 조언을 해주시고 학생들과 친밀한 관계를 유지해주셨기에 수업을 듣는 데 있어 즐거운 시간이 더 많았던 것 같습니다. 또한 학원에서 역시 상담 자기소개서 첨삭 등을 통해 학생들의 학생들의 진로를 위해 노력해주셨습니다. 귀중한 강의를 들을 수 있게되어 감사한 시간이었습니다.', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 26, '물심양면으로 도움주신 선생님 덕에 신기술도 많이 익혔고 완성도 높은 프로젝트도 만들었습니다!! 5.5개월이 언제 가려나~했는데 복습하고 수업 다시 듣고 개인공부 하다보면 너무너무 짧아요! 배울 것도 공부할 것도 너무 많은데 시간이 짧아 아쉬웠습니다 질적으로 높은 수업을 해주셨던 선생님과 취업 도움주신 매니저님~~~~ 정말 감사합니다 :) 강사님께서 열정이 넘치시고 다른 강사님들보다 더 많은 다양한 내용을 알려주려고 노력하는게 보여서 저도 열심히 하게 되었습니다. 강사님께서 상당히 노련하시다는 인상을 받았으며 강사님과 함께 교육을 진행한것이 행운이라고 생각합니다.', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 28, '비전공자 노베이스로 수업 참여하였습니다. 강사님이 꼼꼼하게 설명해주시고 모르는걸 여러번 질문드려도 항상 친절하고 꼼꼼하게 확인해서 답변주셨습니다. 여러번 귀찮게 질문드려도 답변해주셔서 너무너무 감사드렸습니다. 수업내용이 다양하고 많아서 장점일 수도 있으나 사전지식이 하나도 없는경우 따라가기 벅찰 수도 있습니다. 학원 수업 전 자바는 예습하고 가면 좋을 것 같습니다. 결론적으로 김용만 강사님께 수업 들었기 때문에 무사히 수료할 수 있었습니다! 강사님 감사합니다~ 강사님은 매우 친절하시고(질문에 대한 답변을 장문 메일로 저녁에도 받곤 했어요) 모두를 위한 수업을 진행하십니다. 수강생 대다수가 비전공자고 그 안에서 수업 이해도 편차가 꽤 있는데(조별 프로젝트를 진행하면 알고 싶지 않아도 알게 됩니다) 강사님은 이해도 낮은 쪽에 대한 배려가 많으십니다. 저에게는 이것이 단점으로 작용했는데(수업 내용이 그리 어렵지 않았고/진도가 느리다고 느낄 때가 종종 있었습니다) 장점으로 느끼셨을 분도 많으리라고 생각합니다. 과정 자체는 JSP와 Spring Legacy 학습(+프로젝트)에 초점이 맞춰져 있고 Spring Boot React 등 최신 기술은 간단히만 다루는데 후자의 비중이 더 높아지면 좋을 것 같아요(5.5개월이라 다른 국비 과정보다 짧아서 어쩔 수 없는 것 같긴 해요). 김용만 강사님께서 너무 친절하셔서 강사 만족도가 높았습니다. 쉬는 시간을 포함해 수업 중이 아닌 시간에도 항상 친절하게 질문에 답해주셨어요. 단 기간 내에 다양한 프로그래밍 언어를 배울 수 있어서 좋았습니다. 처음 배우는 언어를 java로 시작해 다른 언어들과 비교하면서 진행한 수업방식이 마음에 들었고 수업 시간에 놓친 부분이나 추가적으로 공부할 수 있도록 개인 카페에 학습자료 올려주시는 것도 많은 도움이 되었습니다. 비전공이라서 처음에 많이 걱정했는데 강사님께서 할 수 있다고 동기부여 많이 해주셔서 무사히 수료할 수 있었습니다. 감사합니다!', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 29, '비대면 교육으로 인한 아쉬움빼곤 완벽한 교육이였습니다. 길다고 느끼던 6개월이 어느덧 마무리가 되었네요. 코로나로인한 비대면수업이라 아쉬운 부분도 있었지만 좋은 경험이 되어서 취업에 가까워진 것 같습니다. 정말 코딩에 대해 뜬구름 잡는 식으로만 알고 있었는데 너무 많은 걸 알아가고 얻어갈 수 있어서 좋았습니다 무늬만 전공자여서 이쪽 계열로 취업은 쳐다도 못 볼 수준이었는데 이제는 자신감있게 취업문을 두드려볼 수 있게되었습니다', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 30, '비전공자로써 과연 끝까지 잘 수강할 수 있을지 의문이었습니다. 하지만 수업을 듣고 실습도 하고 팀별로 프로젝트를 진행하면서 조금이나마 제가 맡은 기능을 구현할 수 있는 모습이 너무나 기특해졌습니다. 5.5개월 짧을수도 길수도 있던 기간동안 수강을 완료한 제 자신이 자랑스럽습니다. 선생님 감사합니다!! 매니저님도 항상 잘 챙겨주셔서 감사합니다! 전체적인 수강생 관리 시스템이 매우 우수합니다 과정 따라가기 힘들때 강사님이나 매니저님이 잘 잡아주신 덕분에 무사히 과정 마치고 취업까지 하게된 거 같아요 너무 감사합니다!! 강의 또한 말할 필요없이 너무 좋았습니다! 국비 과정 중에 문제가 될만한 것들도 없었고 행정 문제는 센터 매니저님이 지체 없이 해결해 주어서 좋았습니다. 수업의 질 또한 매우 만족했으며 선생님에게 개인적으로 질문했을 때 원하는 답변 외에도 추가적으로 덧붙여주는 방식이어서 매우 만족했습니다. 수강생들 사이에서도 국비 학원과 선생님을 잘 만났다는 얘기가 여러 번 나올 정도로 전반적으로 만족했습니다.', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 31, '6개월이 안되는 시간이었지만 강사님도 적극적으로 수업 진행해주셨고 매니저님도 많이 챙겨주셔서 수월하게 강의 마무리할 수 있었습니다. 감사합니다. 이 훈련을 배우기전에는 제가 비록 전공을 했지만 부족한 부분도 많고 코딩에 대해 확실하게 배우지못했다고생각했는데 학원에서 다양한언어에 대해서 배우고 이해할수 있어서 좋았습니다. 또한 취업관련 상담이나 회사소개도 잘해주셔서 좋았습니다. 전공 관련자 분들이 이 수업을 듣게 된다면 마지막으로 자신의 실력을 마무리하고 다질수 있는 교육과정인것 같습니다. 수업중간중간 01신호를 통해 이해가 됐는지 파악해 한번더 이해하기 쉽게 설명해주시고 모두가 이해 한 후에 다음 수업으로 진행하시는 점이 좋았습니다. 파이널 프로젝트 시작 전에 세미때 진행했던 팀으로 쭉 진행할것인지 수강생들의 의견을 달라고 하시기 때문에 의견에 따라 같은 팀으로 할 수도 다른 팀 구성원으로 할 수도 있을 것 같습니다. 저희는 세미때 한 팀으로 파이널까지 하자는 의견이 더 많아서 한 팀으로 쭉 세미와 파이널을 진행했습니다. 정규과정 외에도 배워보고 싶은 툴이 있으면 요청받아 하나라도 더 가르쳐 주시려고 하셔서 너무 감사했습니다. 매니저님도 너무 친절하시구 6개월동안 좋은 강의를 들을 수 있어서 좋았습니다!', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 32, '이 과정을 총해 웹 프로그래밍에 대한 전체적인 이해도를 높일 수 있었습니다. 또 선생님께서 잘 이끌어주신 덕분에 수료까지 할 수 있었습니다. 처음엔 거의 햇 병아리에서 부터 시작했지만 지금은 팀원들과 함께 하나의 결과물을 만들 수 있을 정도로 성장해 저 자신도 자신감이 생겼습니다. 감사합니다! 이 과정을 통해 벡엔드 개발에 대해 많이 배울 수 있었고 좋은 강사님을 만나서 운이 좋았습니다. 모르는 건 이해될 때까지 설명해주시고 저녁이나 주말에도 연락드리면 친절하게 알려주세요. 실무에서 많이 쓰는 내용이라던지 실무에 도움이 될 정보들도 많이 알려주십니다. 강사님이 정말 좋으신게 기억에 남아요! 또 듣고 싶은 과정이었습니다. 코로나로 인해 비대면 수업과 현장수업이 병행되었는데 둘 다 불편함 없이 수업진행에 힘써주신 선생님과 매니저님께 감사의 말씀 드리고 싶습니다. 또한 한장희 선생님과 함께한 6개월은 비전공자인 저에게 많은 도움이 되었습니다. 내가 잘하고 있는 걸까 잘 할수 있는 걸까를 반복해서 생각하며 그냥 선생님을 따라서 수업을 들었을 뿐인데 어느 순간 성장해있는 저의 모습을 볼 수 있었습니다. 부족한 질문을 해도 항상 친절하게 알려주셨습니다. 아직도 부족한 실력이지만 코딩의 ㅋ 자도 모르던 저에게 코ㄷ..을 알 수 있게 해주신 한장희 선생님 정말 감사합니다. 그리고 항상 밝게 반겨주시고 챙겨주시던 안혜수 매니저님도 정말 감사합니다~!', to_date('2023-06-07', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 33, '정치외교학과를 나온 나는 철저한 비전공자였다. 소위 상아탑이라는 곳에서 배운 것이라곤 현실감과는 거리가 먼 백지 위 활자들이 전부였다. 낙오될지도 모른다는 두려움이 컸기에 수업이 시작하기 전 2개월간 예습했지만 그마저도 일주일이 못가 진도에 따라잡히고 말았다. 원래라면 나는 낙오되어야만 했다. 그러나 나는 수료했고 현재 마지막 면접을 앞두고 있다. 교수님께서는 낙오자를 만들지 않기 위해 최선을 다해 이끌어주셨다. 그것이 전공자들에게는 다소 답답하게 느껴질 수 있으나 비전공자의 입장에서 교수님의 강의는 따라갈 수 있는 이 아니라 따라갈 수밖에 없는 강의였다. 교수님의 격려와 복습할 수 있는 공백은 비전공자들에게는 꼭 필수불가결한 것이었다. 뿐만 아니라 커리큘럼 상 세미와 파이널을 통해 팀 프로젝트의 협업을 배울 수 있는 것 역시 큰 장점이었다. 끝으로 늘 수업이 끝난 뒤에도 카카오톡으로 개인적인 상담과 고민에 응해주신 교수님 그리고 취업을 위해 항상 힘써주시는 매니저님 함께 동고동락을 함께 하고 또 함께 하는 팀원들에게 감사의 말씀을 전하고 싶다. 강의를 듣는 5.5개월동안 많은 것들을 배울 수 있어서 좋았습니다. java 기초만 알던 과거와는 달리 spring jsp js css 등을 다양하게 구현할 수 있게 되어 제가 많이 발전했다는 것도 깨닫게 되었습니다. 코딩하는 것도 중요하지만 강사님께서 스토리보드나 crud계획서와 같은 것들도 지도해주셨으면 좋겠습니다.', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 34, '3개의 프로젝트를 하며 실력이 점점 쌓이는 것이 눈에 보였습니다. 어려운 부분이나 궁금한 부분이 있을 때 강사님께서 친절하게 알려주시고 도와주셔서 끝까지 수료할 수 있었습니다. 그리고 매니저님께서 항상 수강생에게 불편한 점은 있는지 물어보시면 세세하게 챙겨주셔서 너무 감사했습니다. 좋은 강사님과 매니저님을 만나 취업을 준비하는게 훨씬 수월해 진 것 같습니다. 반년간 비대면이었지만 많이 배우고 갑니다. 강사님 비대면 수업으로 답답하신점도 많으셨을텐데 늘 자세히 설명해주시고 잘 봐주셔서 감사했습니다!', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 35, '수강 전 학원을 찾을 당시 교육을 진행하는 강사마다 수업 진행 수준이 천차만별이라는 이야기를 듣고 좋은 학원을 찾던 도중 쌍용 강북교육센터를 알게 되었고 그중 수강후기를 보면서 김호진 강사님을 알게 되었습니다. 좋은 수업 진행과 열정적인 모습을 통해 수강생들의 평이 좋은 것을 알게 되었고 학원에 문의 후 강의를 신청하고 수강하게 되었습니다. 처음에는 그저 수업을 잘 가르치시는 분으로만 생각했는데 강의를 진행하며 수강생 하나하나를 챙기시며 뒤처지는 학생들이 없도록 노력하시는 모습을 보게 되었고 수업을 수익의 목적으로만 진행하시는 것이 아니라 학생들을 가르치시는 것에 보람을 얻으시는 것을 느끼게 되었습니다. 프로그래밍 지식뿐만 아니라 취업을 위해 필요한 지식들 앞으로 개발자로 살아가며 어떻게 해야 하는지 등 여러 삶에 대한 교훈을 얻게 되는 수업이었습니다. 개발자로서의 첫걸음을 좋은 스승님과 함께하게 되어 영광이었습니다.', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 36, '짧다면 짧고 길다면 길었던 6개월 동안의 시간이 빠르게 지나간 것 같습니다. 처음 접해보는 내용들을 배우며 제한된 시간 안에 많은 분량의 내용들을 소화하는 데에 스스로가 부족하다는 생각도 참 많이 했습니다. 그렇지만 첫 날 수업부터 우리는 한 식구라고 얘기하시며 정말 식구처럼 한 사람 한 사람 뒤쳐지지 않도록 빠짐없이 챙겨주신 선생님 덕분에 버틸 수 있었던 시간인 것 같습니다. 6개월 동안 차근차근 이해 잘 되는 설명으로 따듯하게 학생들을 이끌어주신 선생님 항상 밝은 웃음으로 활기차게 저희를 맞으며 지원해주신 매니저님 6개월동안 매일매일 희로애락을 함께하며 고생했던 동기분들 다들 수고 많으셨습니다.', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 37, '먼저 6개월동안 강사님과 매니저님 그리고 다른 학우분들 고생많으셨습니다. 비전공자에다가 프로그래밍에 관한 지식도 하나도 없고 컴퓨터도 잘못다룰 정도여서 처음에 고민이 많았습니다. 하루에 8시간 동안 수업을 듣는것도 그렇고 다른 국비 수업 후기를 보면 못따라간다는 이야기를 많이 보았기때문에 걱정을 많이 했었는데 김대기 강사님 수업을 듣고 난 직후 지금은 그런 고민을 했다는 것조차 잊었습니다. 전공자 분들의 경우 조금 답답할수있을정도로 정말 사소한거 하나까지 챙겨주시고 알려주시고 비전공자에 대한 배려를 많이 해주셨습니다. 그래서 만약에 실력이 부족하다싶은 전공자분들도 기초부터 탄탄히 쌓으실수있을 것 같고 강사님이 새로운 기술도 많이 알고계시고 특히나 프로젝트 때 질문을 하면 그에 대한 해결책을 너무 잘 알려주셔서 도움이 많이 됩니다. 그리고 매니저님도 행정처리도 빠르게 해주시고 최대한 학생들 편의 위해 도움 주시고 한명한명 잘 챙겨주십니다! 정말 6개월동안 만족스럽고 좋았고 이 수업을 들은것이 정말 다행이다 운이 좋았다라는 생각이 듭니다. 정말 모두에게 감사하다는 말 드리고싶습니다!', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 38, '대학을 졸업하였으나 마땅한 포트폴리오도 없고 코딩에대한 감도 떨어져 있었기에 훈련을 수강하였습니다. 전공자 비전공자 모두 수업을 듣기때문에 기초부터 가르쳐 배울 수 있습니다. 전공자로서 처음엔 쉽다고 느껴질 수 있지만 프레임워크 라이브러리 데이터베이스 등 중반부터의 실용성 있는 수업 내용들은 도움이 많이 되었습니다. 기초부터 실질적인 기술 까지 폭넓게 배울 수 있으며 포트폴리오로 사용할 수 있는 프로젝트 진행과 자기소개서 첨삭 등 원하는 바를 모두 이룰수 있던 수업이었습니다.', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 39, '곽우신 강사님 5.5개월동안 정말 감사했습니다 솔직히 말하면 저도 제가 수료를 할 줄 몰랐습니다. 사실 힘든일도 너무 많았고 아침부터 일어나서 저녁때까지 수업 듣는것도 공부를 하는 것도 개발이 저랑 안맞는거 같다는 생각도 되게 많이 했었고 다른사람들과 힘든일도 있었고 시간 버리는 일인가를 굉장히 많이 고민 했던 거 같습니다. 근데도 제가 다 버티고 끝까지 할 수 있었던거는 강사님이랑 매니저님 덕분입니다 정말 감사합니다. 정말 지금은 제가 그때 그만뒀더라면 지금 정말 많이 후회했을 겁니다. 질문도 정말 많이 했고 쉬운것도 항상 질문해도 항상 친절하게 알려주셔서 감사했습니다. 꼭 회사 들어가서도 열심히 해서 보답하겠습니당 ! 항상 선생님 보다가 안보니까 되게 아쉬워요..! 강사님 매니저님 정말 감사했습니다!!', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 40, '분명 난이도 면에서 힘든 공부긴 하지만 학원에서 함께 공부하면서 실력이 확실히 늘고 있다는 것을 체감했습니다. 전공적인 지식도 그렇고 코딩에 자신감이 붙는 게 정말 큰 수확이라 느낍니다. 한 선생님께서 모든 과정을 알려주시기 때문에 흐름도 정말 매끄럽고 설명을 누구나 쉽게 알려주셔서 비전공자분들도 걱정 없이 들으실 수 있을 것 같습니다. 선생님께서 정말 친절하시고 주말 낮밤 할 것 없이 열심히 가르쳐 주셔서 감사함을 느끼고 있습니다. 질문도 잘 받아주시고 모르는 거 천천히 잘 알려주십니다. 프로젝트도 당시에는 힘들지만 하고 나면 확실히 뭔가를 안다는 것을 느낄 수 있었습니다. 프로젝트에 열심히 참여한 것 참 잘한 일이라고 생각됩니다. 학원 시설도 깨끗하고 특히 화장실이 굉장히 청결하여 너무 좋았습니다. 매니저님께서도 출석과 개인적인 요청들도 흔쾌히 잘 들어주시고 늘 신경 써주시고 계시다는 느낌을 받았습니다. 자소서와 포트폴리오 첨삭도 굉장히 꼼꼼하게 해주셔서 도움이 많이 되었습니다.', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 41, '코로나로 인해 훈련기간의 절반 이상을 비대면으로 진행한게 아쉬울 정도로 너무너무 유익하고 좋았던 최고의 수업이었습니다! 비전공자에 한번도 공부해 본 적 없던 분야였음에도 강사님께서 잘 지도해주시고 이끌어주신 덕분에 훌륭한 개발자로 성장할 수 있었습니다! 경험해 보지 못한 분야의 취업 준비 또한 막막했는데 매니저님께서 잘 가르쳐주시고 도와주신 덕분에 이제는 잘 해낼 수 있을 것 같아요ㅎㅎ 감사합니다~ 고민하시는 비전공자분들 너무 걱정하지 마시고 도전해보시길 바랍니다~ 인생에 세번의 기회가 온다는데 그중 서영학강사님을 만난게 기회였습니다. 6개월동안 정말 너무 잘 알려주셔서 많은 깨달음 알아갑니다. 정말 너무 감사했습니다. 강사님 너무 추천해요!! 서영학강사님 사랑합니다. 서영학 강사님께 웹개발 과정을 수강할 수 있어서 좋았습니다! 강사님의 열정과 꼼꼼함에 실력도 늘고 흥미도 가지게 된 6개월이었습니다. 취업하면 꼭 찾아뵙겠습니다! 이력서를 쓰는 방법 및 피드백을 주신 매니저님도 감사드리고 함께 수강한 학생들 모두 좋은 곳으로 취업이 되었으면 좋겠습니다.', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 42, '강사님과 매니저님께서 열과 성을 다해주셔서 만족했습니다만 코로나바이러스로 인해 대면수업을 자주 못한게 아쉽습니다. 딱히 개선해야할 사항 및 건의사항이 없을 정도로 만족스러운 강의였습니다. 강사님과 매니저님 6개월간 고생 많으셨습니다. 앞날에 좋은 일만 가득하길 바랍니다! 코로나 때문에 대면으로 자주 못해 아쉬웠지만 강사님 강의 들으면서 많이 배웠고 매니저님도 친절히 상담해주셔서 감사했습니다!~ 많은 걸 배울 수 있었습니다 강사님과 매니저님도 정말 능력 좋으시고 많이 노력해주셨습니다.', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 43, '학원의 체계적인 커리큘럼 아래에서 배워야하는 필수적인 개념들을 큰 틀에서 익힐 수 있어 유익한 시간이었습니다. 강사님께서 열정이 가득하시며 정리된 자료를 주셔 큰 도움이 되었습니다. 또한 학원생의 건의와 스케줄을 매니저님이 따로 관리해주시는 등 사소한 부분까지 신경써주셔 공부에 집중할 수 있었습니다. 학원의 시설 또한 깨끗하게 관리되어있고 접근성이 좋아 이용하기에 편리했습니다. 대부분의 수업이 비대면 수업으로 진행되어 아쉬움이 컸습니다. 수업의 내용과 진행에 대해서는 강사의 역량도 역량이지만 학생 개인이 얼마나 더 찾아보고 공부하고 노력하는지에 따라 다르다고 생각하기 때문에 별 말은 하지 않겠습니다. 학원은 필요한 자재들도 충분하며 시설 접근성이 좋습니다. 학원생들의 사소한 건의사항까지 신경써주셔서 감사드립니다.', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 44, '김용만강사님 한명한명 이끌어 가주시려고 하고 질문도 다 받아주셔서 비전공자들도 쉽게 따라 올 수 있을거같아요. 많이 배워갑니다!! 감사합니다. 강태림 매니저님도 학원에 건의 사항있으면 도와주시고 수료 후까지 취업에 도움주시고 감사합니다!!', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 45, '저는 관련 전공도 아니였고 컴퓨터에 관련해서는 완전 무지했었습니다. 학원 수업을 따라가기가 쉬웠다곤 할 수 없지만 들은 수업을 복습하고 열심히 들으면 충분히 따라갈 수 있는 훈련과정이었다고 생각합니다. 타자가 빠른 것도 수업을 듣는 것에 도움이 되겠지만 가장 중요한 것은 수업을 들은 후 다시 한번 정리하는 과정이라고 생각이 들었습니다. 그 과정을 놓친다면 수업을 이해하는 것이 조금 더딜 수 있습니다. 그렇지만 수업 내용을 계속 반복해서 알려주시기 때문에 수업만 들어도 반복학습으로 인해 내용 이해에 큰 도움이 되기도 합니다. 또 강사님께서 학생의 질문과 오류 하나하나를 직접 같이 해결해나가시는 모습이 감사했고 오류를 잡는 방법도 많이 배웠습니다.', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 46, '강사님이 너무 친절하세요! 항상 친절하게 말씀해주셔서 궁금한 점이 있을 때 여쭤보기 어렵지않았습니다. 매니저님이나 팀장님 등등 다른 분들도 항상 응원해주시고 어려운점이 있어 상담을 하면 좋은 말씀 많이해주셔서 5개월이 넘는 시간동안 힘든점 없이 훈련을 마칠 수 있었습니다. 배우는 내용이 쉬운건 아니지만 자료도 많이 올려주시고 한명한명 신경써주시기 때문에 열심히 듣는다면 비전공자도 어렵지않게 수료할 수 있습니다!', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 47, '강사님과 매니저님께서 열과 성을 다해주셔서 만족했습니다만 코로나바이러스로 인해 대면수업을 자주 못한게 아쉽습니다. 딱히 개선해야할 사항 및 건의사항이 없을 정도로 만족스러운 강의였습니다. 강사님과 매니저님 6개월간 고생 많으셨습니다. 앞날에 좋은 일만 가득하길 바랍니다! 코로나 때문에 대면으로 자주 못해 아쉬웠지만 강사님 강의 들으면서 많이 배웠고 매니저님도 친절히 상담해주셔서 감사했습니다!~ 많은 걸 배울 수 있었습니다 강사님과 매니저님도 정말 능력 좋으시고 많이 노력해주셨습니다.', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 48, '과정 내내 프로젝트가 있다보니 확실히 공부가 많이 되고 실력이 늘고 있다는 것을 체감할 수 있었습니다. 비대면으로 주로 진행되었기에 조별 프로젝트 시 불편하기도 했지만 오히려 체력이 비축되어서 많은 프로젝트들을 해낼 수 있었다고 생각합니다. 비전공자지만 자바를 어느정도 예습했기에 초반 진도는 잘 따라갈 수 있었고 스프링 이후부터는 스스로 자료를 찾아가며 공부하는 것이 도움이 됐습니다. 강사님 진도 속도는 학생들마다 다르게 느꼈지만 저는 괜찮았습니다. 완전 기본을 알려주시기 보다는 실제로 실무에서 어떻게 기능을 구현하는지에 집중하시기 때문에 미리 자바 기본을 예습하거나 정처기 공부로 맛보기하는 편이 따라가기 좋을 것 같습니다. 강사님은 구체적인 가이드라인 보다는 방향성을 제시하시기 때문에 본인과 조원들이 함께 회의하는 시간을 많이 가지는 게 좋습니다. 수업만 나가는 게 아니라 직접 구현해 볼 기회가 많아서 저는 매우 만족스러웠습니다.', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 49, '양현수 강사님 수업을 들은 수강생입니다. 강사님은 기초적인 부분도 탄탄하게 가르쳐주시지만 실무에 투입되었을때 상황을 프로젝트 경험을 통해 미리 겪어보게 해주십니다. 프로젝트가 계속 진행되어 가끔은 힘들기도 했지만 과정이 끝난뒤에는 실무에 투입되어도 뭐든지 할 수 있을듯한 엄청난 자신감을 갖게 됩니다. 이건 쌍용교육센터만이 가질 수 있는 강점이 아닐까싶습니다. 국비지원교육에서 강사님 학원 잘못 골라서 고생한 사례들을 보고 걱정했었는데 교육을 시작하며 그런 걱정이 다 날아갔습니다. 매니져님과 강사님의 섬세한 케어로 교육을 제외하고는 아무것도 신경쓰지 않아도 되었고 그래서 정말 만족스러운 프로젝트 결과를 얻고 갑니다. 비전공이셔도 걱정할것 없습니다. 강사님이 비전공자도 모두 이해할 수 있도록 이끌어주시고 계속 의견을 물어봐주시기 때문에 이해 안되는 부분은 금방 해결되는 편이었습니다. 교육을 진행하는 내내 쌍용교육센터가 왜 최우수교육기관인지를 알 수 있었습니다. 국비지원교육은 인생에 한번뿐인 기회이니만큼 잘 선택해야하는데 쌍용이라면 후회하지 않을거라고 확신합니다. 마지막으로 강사님 매니져님 6개월간 정말 감사했습니다!! ♥', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 50, 'SW개발자가 되기 위해 혼자서는 알아볼 것도 많고 준비해야할 것도 많은데 교육과정을 수강하며 같은 환경에 있는 사람들과 정보공유도 하고 센터에서 제공해주는 레퍼런스와 교육내용은 아무것도 모르던 비전공자에게 큰 도움이 되었고 만약 비전공자가 개발자를 희망한다면 해당 센터를 꼭 추천해주고 싶습니다. 특히나 강사님과 매니저님이 6개월간 성심성의껏 원생 관리와 강의를 준비해주셔서 많은 도움이 되었습니다. 좋은 학원 강사님 매니저님을 만나서 만족스러운 교육환경에서 교육을 수료하였습니다. 감사합니다. 실습 위주로 훈련이 진행되어 지루하지 않게 하루 수업을 들을 수 있었다. 하루에 너무 많은 양을 배워 힘든 점도 있었으나 프로젝트를 하면서 문법을 사용하다보니 수업에서 배운 것을 내가 설명할 수 있을 정도로 문법 활용이 가능해졌다.', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 51, '항상 모르는것이 있을 경우에 매니저님과 선생님께서 빠르고 정확하게 답변해주셨습니다. 또한 프로젝트의 순서또한 자바 -> 디비 -> jsp -> 스프링 순으로 진행되어서 이해하는데에 무리가 없었습니다. 지금은 수료를 하지만 아직 학원을 다니지 않는 학생들에게 추천해주고 싶습니다. 제가 취업한것과 배울수 있게 도와주신 매니저님과 선생님께 다시 한번 감사의 말씀 전합니다!! 점수로치면 10점만점에 100점정도??입니다ㅎㅎ', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 52, '모르는 것은 선생님께 바로바로 물어보면서 수업을 잘따라갈수 있었고 매니저님도 항상 신경써주셔서 수업에만 집중할수 있도록 많이 도와주셨습니다! 수강신청전에 강사님으로 걱정하신다면 박세인강사님 정말 강추드립니다!! 이해가 잘되도록 설명해주시고 학생들이 헤맬수 있는 포인트 파악을 너무 잘해주셔서 최고였습니다:-)', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 53, '선생님과 매니저님 두분의 도움 덕분에 무사히 수료를 마칠 수 있었습니다 . 처음 시작땐 상당히 막막하고 길게만 느껴졌던 과정이었는데  선생님의 훌륭한 수업과 매니저님의 케어 덕분에 시간 가는줄 모르고 수료를 하게되었습니다 . 마지막 취업이라는 목표를 이룰때까지 도움을 주신다고 약속을 하셔서 정말 믿음이 갑니다. 다른 지인이 이러한 과정을 찾고있다면 꼭 추천하고 싶습니다."', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 54, '강사님도 친절하셨고 매니저님도 친절하셨습니다. 다른 곳도 몇 군데 봤지만 여기 매니저님이 정말 친절하십니다. 컴퓨터 환경 같은 부분도 자신이 해결하고 싶은 부분은 해결할 수 있어서 괜찮습니다. 코딩을 몰라도 수업을 따라갈 수는 있어요. 다만 응용할 수 있는 방법에 대해 공부하기가 힘들 수도 있으니 예습하시는 것을 추천 드립니다. 또한 기초과정을 배우기 때문에 현업에서 사용하는 시스템이나 툴에 대해는 배우지는 않지만 프로젝트를 할 때 같이 접목해서 진행하면 더 좋을 것 같네요. 이 부분은 학원에서 살짝 알려주면 더 좋을 것 같지만 시간이 부족해서 아쉽네요. 팀원들도 다 좋았고 제가 원하는 방향으로 프로젝트를 진행할 수 있어서 참 좋았습니다. 공부할 의지만 있다면 들어도 후회는 안 할 것 같아요.', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 56, '꼼꼼하게 알려주시는 선생님 언제나 친절하게 케어해주시는 매니저님 모두 최고였습니다. 코로나가 아니었다면 더 즐겁게 배웠을거에요. 다들 쌍용하세요~', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 57, '강사님이 수강생 하나하나에게 관심을 갖고 계시고 하나부터 열까지 차근차근 알려주셔서 좋았습니다. 뒤쳐지는 학생이 생기지 않게 매번 강사님이 직접 오류를 잡아주셨고 학생들이 잘 따라오고 있는지를 항상 확인하며 수업을 진행하셨습니다. 특히 대학에서 배울 수 없던 실무와 관련된 이야기도 유익했습니다. 강사님 뿐만 아니라 매니저님도 수강중에 불편한 사항이 없는지 항상 친절하게 살펴주셔서 수업을 더 편하게 들을 수 있었던 것 같습니다. 수업을 듣는 5.5개월간 코로나 때문에 때론 힘들기도 했지만 강사님과 매니저님이 함께 해주셔서 무사히 과정을 마칠 수 있었던 것 같습니다. 다시 한 번 강사님과 매니저님께 감사드립니다.', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 58, '5.5개월이 정말 만족스러운 교육과정이었습니다. 김호진 강사님은 항상 수업에 대한 준비가 철저하시고 수강생 한 명 한 명 신경 쓰시는 게 너무 잘 보였습니다. 강사님 덕분에 지식을 차근차근 잘 쌓아나갈 수 있었습니다. 장유진 매니저님도 항상 불편한 게 없는지 체크하고 해결할 수 있는 문제들은 바로 해결해주셔서 두 분 모두 감사했습니다. 그리고 현재 코로나 때문에 상황이 많이 불안정하지만 학원에서 상황에 맞게 바로바로 대응해서 안내해 주셔서 잘 마무리할 수 있었어요 :>', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 59, '인터넷의 떠도는 말로 국비는 좋지 않다고 해서 걱정한것과 다르게 강사님이 너무 좋으셨습니다  역시 국비 3대장 학원  코로나 시국에 일주일에 한두번씩만 오프라인 수업인게 너무 아쉬웠지만  국비 학원에서 얻을수 있는것은 다 얻은것 같습니다 게시판은 어떻게든 혼자 짤 수 있을것 같아요. 강사님이 친절하지만 또 카리스마 있게 ㅋㅋ 가르쳐 주신게 기억에 남을것 같습니다. 여기서 처음 개발을 제대로 배우게 되었는데 정말 6개월 전과 지금은 상상도 할 수없이 발전 한것 같습니다  저는 아직 멀었지만 열심히 가르쳐주신 강사님과 잘 챙겨주신 매니저님 감사드립니다...! 커리어 시작 잘 해보겠습니다!', to_date('2023-08-17', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 60, '강사님께서 항상 자세하고 친절하게 설명해주셔서 좋았습니다. 비대면이라서 수강생들로부터 같은 질문이 여러 번 반복되어도 매번 친절하게 알려주셔서 감사했습니다. 비전공자라서 진로를 정한 후 막막했는데 훈련과정에서 팀 프로젝트를 두 번 진행하면서 실습을 해볼 기회가 있어 좋았습니다.', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 61, '열정적이시고 즐겁게 수업할 수 있도록 도와 주시고 가르쳐 주신 한장희 선생님께 정말 감사드립니다 국비 수업에 대한 안 좋은 말이 많은데 한장희 선생님을 뵙고 배울 수 있어 정말 행운이었다고 생각합니다. 많은 것을 알고 계시고 현재 업계에서 어떤 것을 어떻게 사용하는지도 잘 아셔서 그런 방식으로 잘 설명해 주셔요. 정말 좋은 분이셔서 수료 후에도 연락을 하는 수강생 분들이 많더라구요. 이것만으로도 선생님의 인품을 알 수 있었어요. 게다가 수업도 정말 이해가 잘 가게 알려 주십니다. 매일 처음 시작하는 9시에 저번 시간에 배웠던 것들을 짧게 요약설명해주시는데 정말 큰 도움이 되었습니다. 선생님께서는 비전공자여도 어떻게 설명해야 이해가 잘 되는지 아시는 것 같았어요. 나눠주시는 자료도 공부하고 이해하기에 정말 좋았고 커리큘럼도 정말 공부하기에 최적이었습니다. 가르쳐주시는 방식 또한 기초부터 차근차근 시작하여 쌓아갈 수 있는 방식이어서 너무너무 좋았어요. 한장희 선생님께서는 질문에도 친절하게 설명해주셨습니다. 정말 수강생의 이해를 돕기 위해 눈높이 식으로 설명을 해주시며 최선을 다하신다는 느낌을 받았습니다. 프로젝트 기간에는 이른 아침부터 늦은 밤에도 주말에도 저희들의 질문을 다 받아주시느라 너무 고생하셨습니다. 한장희 선생님께서는 수강생들에 대한 배려도 정말 크십니다. 매일 출석체크 화면캡처하면서 시간이 지체되면 힘드셨을 텐데 그럼에도 끝까지 열정을 다해 가르쳐주시는 분이셨어요. 정말 좋은 분이시다라는 걸 느낄 수 있었습니다. 점심 후에 먼저 말 걸어 주시기도 하고 따스한 격려도 해주시고 상담도 해주시고 앞으로 어떻게 개발자로서의 방향을 잡아야 할 지도 깨달았어요. 선생님의 지식과 인품에 많은 감동 받았습니다 감사합니다. 선생님이 너무너무 실력있으시고 좋으신 분이라서 수강생이 모두 수료할 수 있었던 것 같습니다.', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 62, '비전공자인데다 프로그래밍 관련 지식이 전무했던 터라 처음 강의를 수강하기 전부터 많은 부담감이 있었지만 강사님과 매니저님께서 많이 신경써주신 덕분에 무사히 수료할 수 있었습니다. 수업 자체도 자세한 설명과 함께 차근차근 진도를 나가셔서 수업을 따라가는 것에 큰 무리가 없었고 모르는 것은 질문할 경우 상세히 답변해주셔서 감사했습니다. 취업지원의 경우 매니저님이 학생 한 명 한 명 신경써서 봐주신다는 게 체감이 될 정도로 잘 챙겨주시는 편입니다. 수료한 이후에도 일정 기간동안은 계속해서 포트폴리오나 입사지원과 관련된 부분에 대해 도움을 주시기 때문에 이 부분이 가장 만족스럽습니다. 수강센터에서 기초적인 내용부터 심화 내용까지 차근차근 가르쳐주셔서 학습에 많은 도움이 되었습니다. 앞으로 개발자가 되는데에 기초 지식을 쌓을 수 있었던 좋은 시간이었다고 생각합니다. 항상 친절하신 곽우신 강사님 잘 챙겨주시는 장혜진 매니저님 감사드립니다.', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 63, '강사님이 수업내용준비를 굉장히 잘 하시고 수업시간에도 이해가 쉽도록 반복적으로 친절히 설명해주십니다. 수업 중 질문이나 프로그램 오류가 났을때도 원격으로 도와주시고 매우 만족스러운 과정이었습니다. 비전공자 입장에서 수업을 따라가기 버거울까봐 걱정했었는데 충분히 따라올 수 있도록 강사님이 도와주셨습니다. 이 과정 자체는 만족스럽고 강사님도 잘 가르쳐주시지만 비전공자라면 과정 시작전에 자바가 뭔지에 대해서 입문강의를 몇개라도 듣고 시작하는걸 추천합니다. 초반 자바 수업시간에 코드 따라치기 바빠서 정작 내용 이해하는데에는 어려움을 겪었던 기억이 납니다. 행정 관련해서는 매니저님이 정말 친절하게 많이 도와주셨고 애로사항이나 불편사항 같은게 있는지 항상 물어봐주시고 개선이 필요한 부분이 있으면 개선될수있도록 많이 도와주셨습니다. 그리고 항상 친근하게 다가와주셔서 더 좋았습니다ㅎㅎ 같이 수업 들었던 수강생분들도 다 열심히 하는 분위기였어서 자극받으면서 더 열심히 할 수 있었던 것 같습니다 수강생들에게 하나라도 더 가르쳐주려고 열심히 수업해주신 강사님과 수업외적으로 챙겨주셨던 저희반 매니저님 정말 감사드립니다.', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 64, '1. 선생님(서영학선생님) : 비전공자지만 처음에 변수부터 차근차근 알려주시고 질문하면 정말 친절하게 알려주심. 코로나라 온/오프 로테이션으로 했는데 집에서 하는 경우는 원격으로 직접 코드 봐주시고 해결해주심. 진짜 질문 너무 많이 하는거 아닌가 생각들정도로 많이 물어봐도 매번 친절하게 알려주시고 수업 끝나고도 봐주시고 개념을 이해하도록 잘 설명해주심. 면접에서 나올 수 있는 개념들도 꼭 기억하라고 알려주심. 강의력도 좋으시고 매번 분위기 좋게 하시려고 노력해주심. 인기 만은 쌤이라고 들었는데 정말 수업 속도도 적당하고 전달력도 훌륭하심 2. 커리큘럼 : 자바->오라클->htmljavascriptjsp->spring 순서로 하는데 자바오라클 끝나고 미니플젝 spring전에 세미플젝 spring 하면서 파이널 플젝 하는데 직접 배운걸 프로젝트에서 써먹을 수 있어서 좋음 3. 매니저님(안혜수매니저님) : 정말정말 친절하심 평소 출결관리나 전반적인 훈련하는데에 하나하나 잘 신경써주시고 취업 관련 정보도 알려주시고 자소서랑 포트폴리오 구성하는 법도 알려주시고 첨삭도 해주심 훈련과정 끝나는 시기즈음에는 취업정보도 단톡에 많이 올려주시고 상담도 해주심', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 65, '##### 수강후기 #### # SI를 희망하는 분들께 적극 추천드립니다. ## 수업방식 - 개발자는 코딩만이 중요한 게 아니라 프로세스 제 생각을 잘 정리하는 것이 중요함을 수업 중에 많이 배우게 됩니다. 선생님께서 프로세스에 대해 매우 강조하시면서 강의하십니다. 코딩할 때 주석을 먼저 작성하고 코딩하는 습관을 자연스럽게 기르게 됩니다. - 수업을 진행하고 예제를 보여준다음 비슷한 예제를 풀게끔 하십니다. 수업 후 과제를 내주시는데 복습하는데 정말 유효합니다. ## 프로젝트 - 5번의 프로젝트를 진행하면서 정말 힘들었지만 프로젝트를 만들기위해 어떻게 협업하고 진행할지 많은 고민과 노력을 하게됩니다. 이를 통해 앞으로 어떠한 프로젝트를 하든 구성원들과 협업하는데 자신감이 생성됩니다. - 매 프로젝트가 길지 않습니다. 시간이 충분하지않기 때문에 분업과 우선순위 일정관리를 효율적으로 하는 방법을 자연스럽게 익히게 됩니다. ## 주의 - 수업 진도가 빠르기 때문에 적어도 자바의정석으로 7장(왜 객체지향이 중요하고 관심사 분리가 중요한지)까지 DB로 CRUD하는 방법 CSS(margin과 padding flex 이해) JS(DOM객체 함수 등)은 익히고 오셔야 수업 진도를 따라갈만 하십니다. 코딩이 완전 처음이시면 밤을 새는 노력으로 해야 따라갈 수 있는 진도 속도입니다. 물론 선생님께서도 천천히 진행하시고 잘 설명해드리고자 노력하십니다.', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 66, '강사님을 믿고 따라간 덕분에 좋은 성과를 얻을 수 있습니다. 한 철학자의 글귀가 생각납니다. 좋은 선생이란 무엇인가? 나 처럼 똑같이 해라고 말하는 자는 좋은 선생이 아니다. 나를 따라해보거라! 라고 말하는 자가 좋은 선생이다. 생각없이 똑같이 하게 만드는 것은 학생에게 독이 되는 것이고 직접 생각하고 고민할 때 사람이 성장할 수 있다는 것이 아닐까요? 이 과정을 진행하며 많은 어려움을 겪을 수 있습니다. 그렇다고 무턱대로 코드를 똑같이 타이핑한다고해서 실력이 늘지 않습니다. 직접 고민하고 직접 코드를 짜야만 개발 실력이 성장할 수 있습니다. 그런 측면에서 강사님께서 강의를 진행하는 방식. 즉 학생들이 고민하고 스스로 성장할 수 있는 방식으로 진행한다는 점에서 양현수 강사님은 좋은 선생님이라고 생각합니다. 힘들 수 있습니다. 과제도 많고 프로젝트도 많습니다. 하지만 치열하게 그 과정을 마무리 했을 때. 얻을 수 있는 성과는 경쟁력 있는 개발자로 변한 자신의 모습이고 개발을 즐기고 있는 자신의 모습입니다. 저는 양현수 강사님 밑에서 지난 6개월간 훈련을 받은 것이 정말 탁월한 선택이었다고 생각하고 있습니다. 이 글을 읽고 있는 분이 정말 치열하게 취업을 준비할 생각이라면 양현수 강사님을 적극 추천합니다. 치열하게 훈련을 받으면 여러분의 원하는 포트폴리오를 가뿐하게 만들 수 있을 것입니다. 그동안 감사했습니다. ps. 니체가 이런말을 했다고 합니다. 나를 죽이지 못하는 고통은 나를 더 강하게 만든다 이 글을 읽고 있는 여러분을 응원하겠습니다.', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 67, '운이 좋게도 박O인 선생님과 장O진 매니저님이 담당한 반에서 교육과정을 들을 수 있었습니다! 어느 정도 커리큘럼이 정해진 국비 교육과정 속에서도 그 안에서 고기를 단지 건져주는 게 아니라 어떻게 고기를 낚을 것인지 가르쳐주셨던 선생님과 안팎의 운영을 책임지고 교육생을 고려한 소통을 하셨던 매니저님 덕분에 과정을 무사히 마치고 개발자로서의 새 시작을 딛게 되었습니다. 기본 지식과 재능의 차이는 분명히 있겠지만 동일한 IT 분야 종사를 목적으로 하는 수강생들끼리 일정 기간동안 협업하며 자극동기가 되어줄 수 있다는 것 실무 경력이 있는 선생님으로부터 프로젝트 제작을 해볼 수 있다는 것 교육과정이 매니저님 덕분에 교육생을 고려한 시점에서 원활히 운영될 수 있다는 것이 큰 장점이었습니다.', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 68, '교육센터에 입과하기 전부터 비전공자의 신분으로 코딩을 공부하려 나름 애쓰긴 했으나 (제가 그리 똑똑하지 않은 관계로..)코딩과 전혀 상관없는 직종에 근무하며 인터넷 상의 두서없는 정보들 속에서 공부 방향을 설정 및 몰두하기에는 어려웠습니다. 환경의 변화가 필요함을 깨닫고 이번 교육과정이 그 당시의 삶을 바꿀 수 있는 기회라고 생각하고 수강하였습니다. 수강하며 느낀 점은 그동안 공부했던 제 코딩 밑천은 바닥이며 이 교육과정 내에서만 해도 저보다 훨씬 더 빨리 이해하고 잘하는 분들이 많다는 것이었습니다. 부족함이 시시각각으로 느껴지는만큼 보폭을 맞추려 애썼고 다행히 구직 활동에도 좋은 결과를 얻을 수 있었습니다. 다시 새 시작을 할 수 있게 큰 도움을 제공해주신 선생님과 매니저님께 감사한 마음입니다. 더 속도를 내어서 열심히 해보고 싶다는 동기를 주셔서 정말 감사합니다.', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 69, '저는 전공자임에도 기초부터 다시 배우고 싶다는 생각에 학원을 등록했는데 이O익 강사님께서 정말 기초부터 하나씩 개념을 다시 짚어주셔서 전공에 다시 흥미를 느끼며 공부 했습니다. 비대면 수업이라 모르는 것은 어떻게 하지? 라는 걱정이 있었는데 강사님께서 카톡과 팀뷰어를 사용해서 왜 오류가 발생했고 해결방법까지 꼼꼼히 알려주셔서 어려움 없이 수업에 잘 참여할 수 있었습니다. 엄O선 매니저님 또한 강사님과 함께 학생들에게 세심한 것 까지 꼼꼼히 챙겨 주셔서 어려움 없이 6개월 과정을 잘 마무리 할 수 있었습니다. 좋은 강의를 듣게 해준 쌍용교육센터 선생님들께 너무 감사드립니다.', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 70, '5.5개월동안 좋은 교육과정을 통해 대학에서보다 좀 더 실무에 가깝게 배울 수 있어서 좋았습니다. 김O기 강사님께서 지도해주셨는데 필기도 꼼꼼하시고 강의시간에 충분한 실습시간을 제공해주셔서 좋았습니다. 학원직원분들도 친절하시고 코로나로 인해서 온라인 줌강의가 되었을 때도 수강생들이 불편하지않도록 빠르게 조처를 해주셔서 좋았습니다 학원도 친절하고 김O기 강사님께서도 능력있으셔서 5.5개월이 아깝지 않았습니다. 수업에 집중 할 수 있도록 매번 세심히 챙겨주신 안O수 매니저님도 정말 감사합니다!!', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 71, '자바를 독학으로 몇번 시도하다가 포기한적이 있어서 이 수업을 듣는다고 달라질까 반신반의했는데 실력이 많이 오른거같아 뿌듯하고 알찬 6개월이였습니다. 강사님이 차근차근 디테일하게 설명해주셔서 좋았고 중요한 부분은 계속 반복해주셔서 이해하는데 도움이 됐습니다:) 전공자분들이 너무너무 많고 잘하셔서 약간 위축됐지만...그래도 많이배워갑니당~~~ 6개월동안 정말 감사했습니다ㅠㅠㅠ 전에는 할수있는게 없어서 이력서도 못넣었는데 이젠 넣을수있는 곳이 생겼어요ㅠㅠㅠㅠ', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 73, '복O순 강사님을 만나뵙게 된 건 제 개발자 인생의 아주 좋은 시작이라고 생각합니다. 전문적인 지식 뿐만 아니라 코딩에 대한 열정 삶의 태도도 배울 수 있었습니다. 아침에 1시간 일찍 나오셔서 수업을 준비하시고 꾸준히 자격증 공부를 하시는 모습을 보며 저 또한 자극을 많이 받았습니다. 수업 내용은 하나도 빠뜨릴 것 없이 알찼습니다. 일례로 제가 회사 입사를 위해 필기 시험을 볼 때 수업 내용에서 다 나왔기 때문입니다. 강사님께서 유독 그 부분들을 강조하셨기에 기억하고 있었고 덕분에 만족스러운 기업에 취업하게 되었습니다. 학원 수강을 망설이는 사람들에게 쌍용 학원은 무조건 수강하라고 말씀드리고 싶습니다. 그리고 그 과정이 복O순 강사님이라면 무조건 수강해야 합니다. 저 또한 학원에 들어오기 전에 어떤 학원이 좋고 어떤 과정이 좋은지 걱정을 하며 검색을 했습니다. 그런데 학원을 정하기 위해 아무리 많이 검색 해봐도 머릿속만 복잡해질 뿐입니다. 그냥 쌍용 학원과 강사님을 믿고 따르면 좋은 결과가 있을 겁니다. 지금의 저를 있게 해주신 복O순 강사님 그리고 장O진 매니저님께 너무너무 감사드립니다. 이 은혜 잊지 않고 평생 간직하겠습니다. 그동안 감사했습니다.', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 74, '학교에서 수업을 받았으나 미흡하고 부족한 점이 많았습니다. 이에 부족한점을 채우고자 훈련교육을 알게 되었으며 괜찮은 곳들을 알아보던 와중 쌍용교육센터를 알게 되었고 이 수업을 받으면서 학교에서는 가르쳐주지 않았던 것들과 팁들을 알려주었습니다. 또한 교육과정도 체계적이라 수업만 들어도 매우 도움이 됐습니다. 프로젝트를 진행하며 회사에서 실제로 하는 실무를 체험할 수 있었으며 개발자로서 중요한 팀워크 협업들을 배우게 되었습니다.', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 75, '비전공 컴맹으로 추가 합격으로 들어가서 솔직히 걱정이 많았습니다. 하지만 선생님께서 비전공자들도 알기 쉽도록 차근차근 자세히 알려주셨습니다. 유익한 정보들과 신기술들을 많이 습득하였고 기본 용어도 모르던 저는 어느새 웹사이트도 제작하게 되었습니다. 하나하나 제작되는 과정 물이 눈에 보이게 되니 재미가 붙었고 에러로 발목 잡혀 막막하던 문제들도 선생님한테 조언을 얻으니 손쉽게 해결되었습니다. 6개월 동안 정말 유익한 시간을 보냈습니다. 코로나로 취업도 막막한 시긴 대도 불구하고 그래도 어딘가는 취직하겠지 하는 없던 자신감도 생기게 해주는 수업이었습니다. 한 명 한 명 포기하지 않고 끝까지 붙들고 가주시고 관심을 주셔서 정말 이런 수업은 다시 찾기 힘들 거 같습니다.', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 76, '박*인 선생님이 Java의 기초부터 웹언어 스프링 프레임워크까지 개념을 제대로 잡아주시고 그 개념을 토대로 수업을 진행하셔서 따라가는 것이 쉬웠고 정말 제대로 배울 수 있었습니다. 분에 넘치게 좋은 선생님을 만난 것 같아서 좋고 제대로 배운 6개월이었습니다.', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 77, '제일 먼저 학생들을 먼저 챙겨주시고 학생들을 위해 열의있게 강의해주신 김*선 강사님과 끊임없이 학업에 집중할수 있도록 서포트를 해주신 엄*선 매니저님께 정말 감사하다는 말씀을 드리고 싶습니다. 김*선 강사님께서는 오로지 학생들을 위해 강의를 해주시는 분이십니다. 학생들의 표정을 읽으면서 이해가 되지 않은 것 같은 반응이면 이를 바로 알아채시고 설명을 학생들이 이해 할수 있을 때까지 설명을 해주십니다. 그리고 낙오되는 학생없이 학생 한명한명을 꼭 챙겨가시려는 따뜻함도 갖고 계십니다. 엄*선 매니저님께서는 세심한 것 까지 꼼꼼하게 잘 챙겨주시고 어느 하나 빠지지 않도록 정말 잘 도와주십니다. 정말 두분이 계셔서 이 6개월과정을 무사히 마칠 수 있었습니다. 수업내용은 웹개발의 전반적인 것을 배울 수 있는 아주 의미있는 과정이였습니다. 이 과정을 바탕으로 앞으로 좋은 프로그래머가 될 수 있을 것이라고 자부합니다. 좋은 강의를  듣게해 준 쌍용교육센터에게 감사드립니다.', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 78, '김O룡 강사님이 너무 좋으셨어요..정말 진심으로 좋으셨어요. 학생들에게 성심성의껏 신경써주시고 코딩에도 굉장히 애정 많아 보이셨고요ㅎㅎ 학원 정하는데 있어서 거리랑 선생님이 가장 큰 기준이었는데 만족합니다. 제가 좀 받아들이는게 느렸지만 끝까지 따라갈 수 있게끔 선생님께서 많이 도와주셨어요 감사합니다!', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 79, '인터넷글과 다르게 저는 매우 만족했습니다 사실 학원등록하기 전 학원이 뽑기? 라고 들었습니다 실무에 전혀 쓰이지않는걸 가르쳐준다거나  수업을 어렵게 한다거나 등 그런 두려움이 조금 있었는데 정말 다행히 여기 강사님은 수업을 그림형식으로 진행하여 이해 하기가 쉬웠고 매번 반복적으로 그림형식을 그려주기에 머리속에 확실히 각인이 돠었습니다 질문 또한 잘받아주시고 잘설명해주십니다 (질문하는게 전혀 부담이 안됩니다) 수업도중에도 실무에 어떻게 쓰이는지에 대한것도 설명해주셔서 이게 실무에 이렇게 쓰이는구나 라고 이해도 하기도합니다 저희 반 담당 매니저님 또한 취업활동에 적극적으로 도와주십니다 그래서 거리낌없이 이것저것 물어보게됩니다 프로젝트를 3번 진행하는데 매 파트 마다 프로젝트를 진행하기에 그 파트에 이해가 확실히갑니다 약 2개월 주기로 프로젝트가 새롭게 진행되는데 자바awt - 홈페이지제작 - 홈페이지제작 (spring) 매 프로젝트마다 새롭고 재밌습니다 결과적으로 저는 6개월간 매우 만족했습니다 친구가 만약 하게된다면 저는 반드시 이곳을 추천할겁니다! 감사합니다.', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 80, '이*미 강사님의 수업 진행방식 너무 좋았어요. 모르는 게 생겨서 질문할 때마다 꼼꼼히 친절하게 알려주시고 학생들을 위해주시는 마음이 느껴져서 너무 감사했습니다. 그리고 제가 자신감이 많이 부족했는데 칭찬 많이 해주시고 모두 다 잘될 거라고 말씀해주셔서 큰 힘이 됐어요. 다시 수업을 들어도 이*미 강사님께 듣고싶어요. 그리고 매니저님도 신경 많이 써주셔서 감사합니다. 비전공자여도 7개월 동안 열심히 하면 취업하는데 문제없을 것 같아요.', to_date('2023-08-01', 'yyyy-mm-dd'));
insert into tblReview values (review_seq.nextval, 82, 'IT국비지원은 피해자가 많다는 둥 배울 게 없다는 둥 인력파견업소로 출장을 간다는 둥 이상한 소문이 무성했는데 이러한 논란거리를 잠재워 준 명강의를 들을 수 있었습니다. 강사진이 공개되지 않아서 불안하고 불편한 마음도 있었으나 애초에 쌍용강북교육센터는 악평 자체를 찾기 힘들었던 기억이 있었고 인터넷으로 검색한 결과 좋은 평들이 많았기 때문이지요.. 아마 이 평을 찾고 계신 분들도 최상의 교육을 원해서 찾아보시는 분들이시겠지요? 국가가 나서서 개인에게 최소 600만 원 이상을 투자하는 만큼 교육생도 이전에 교육에 관해 미리 예습할 것을 당부드립니다. 국비과정은 이 학원뿐 아니라 다른 강좌도 마찬가지로 대학 4학년치 과정을 반 년 만에 이수해야 하는 과정이기 때문에 비전공자라면 매우 벅차고 예습이 없다면 교육달성효과는 절반도 미치지 못할 것입니다(① 영타 300타 이상 ② 자바 문법 1회독 ③ HTML CSS Javascript 예습 등). 최대한 공부하고 오셔야만 600만 원 어치의 효과를 볼 수 있다는 점을 유념하시고 교육을 수강하시기 바랍니다. (중략) 참고로 지인에게 들었는데 국비수업 과정은 후반부로 갈수록 듣는 인원이 줄어든다고 합니다. 저희 반의 경우에는 대부분 끝까지 출석했습니다. 국비지원을 통해 개발에 입문하시는 분들께 충분히 도움이 되셨길 바랍니다. 세금으로 국가에서 개인에게 투자하는 돈이니까 그 이상 얻어 가시기 바랍니다.', to_date('2023-08-01', 'yyyy-mm-dd'));
