insert into tblAnswer values (answer_seq.nextval, 138, '컨텍스트 및 속성 답변입니다. 영속성 컨텍스트란? 영속성 컨텍스트는 엔티티를 영구 저장하는 환경입니다. 엔티티 매니저를 생성하면 자동으로 영속성 컨텍스트가 생성되고 엔티티를 관리 혹은 보관할 수 있습니다. 영속성 컨텍스트의 속성 비영속 : 영속성 컨텍스트와 전혀 무관한 상태로 순수한 객체의 상태 .처음 객체가 생성되면 비영속 상태 영속 : 영속성 컨텍스트에 저장된 상태 준영속 : 영속성 컨텍스트에서 관리하다  영속성 컨텍스에서 분리된 상태  준영속 상태는 영속 상태 였던 적이 있기 때문에 @Id 값을 반드시 가지고 있습니다. 삭제 : 삭제된 상태 ', to_date('2023-08-23', 'yyyy-mm-dd'));
insert into tblAnswer values (answer_seq.nextval, 139, 'SpringBoot는 Spring Framework에서 사용하는 프로젝트를 간편하게 셋업할 수 있는 서브 프로젝트입니다. 독립 컨테이너에서 동작할 수 있기 때문에 embeded tomcat이 자동으로 실행됩니다. SpringBoot만의 특징 - 애플리케이션을 신속하게 세팅할 수 있습니다.추가 WAS 설치 없이 embeded tomcat으로 실행합니다. 번거로운 개발 세팅을 대신 해줍니다. ', to_date('2023-08-15', 'yyyy-mm-dd'));
insert into tblAnswer values (answer_seq.nextval, 140, 'DispatcherServlet : 어플리케이션으로 들어오는 모든 Request를 받는 관문입니다. Request를 실제로 처리할 Controller에게 전달하고 그 결과값을 받아서 View에게 전달하여 적절한 응답등 생성할 수 있도록 흐름을 제어한다. HandlerMapping : Request URL 각각을 어떤 Controller가 실제로 처리할 것인지 찾아주는 역할을 합니다. Controller : Request를 직접 처리한 후 그 결과를 다시 DispatcherServlet 에게 돌려줍니다. ModelAndView : Controller가 처리한 결과와 그 결과를 보여줄 View에 관한 정보를 담고 있는 객체입니다. ViewResolver : View 관련 정보를 갖고 실제 View를 찾아주는 역할을 합니다. View : Controller가 처리한 결과값을 보여줄 View를 생성합니다. ', to_date('2023-08-08', 'yyyy-mm-dd'));
insert into tblAnswer values (answer_seq.nextval, 141, '1. DispatcherServlet : 어플리케이션으로 들어오는 모든 Request를 받는 관문입니다. Request를 실제로 처리할 Controller에게 전달하고 그 결과값을 받아서 View에게 전달하여 적절한 응답등 생성할 수 있도록 흐름을 제어한다. 2. HandlerMapping : Request URL 각각을 어떤 Controller가 실제로 처리할 것인지 찾아주는 역할을 합니다. 3. Controller : Request를 직접 처리한 후 그 결과를 다시 DispatcherServlet 에게 돌려줍니다. 4. ModelAndView : Controller가 처리한 결과와 그 결과를 보여줄 View에 관한 정보를 담고 있는 객체입니다. 5. ViewResolver : View 관련 정보를 갖고 실제 View를 찾아주는 역할을 합니다. 6. View : Controller가 처리한 결과값을 보여줄 View를 생성합니다. ', to_date('2023-08-30', 'yyyy-mm-dd'));
insert into tblAnswer values (answer_seq.nextval, 142, 'AJAX를 사용할 때 JSON의 응답을 많이 사용하시죠. 이때 JSONObject을 응답하는 method 위에 @ResponseBody 라는 annotation을 설정하시면 View JSP를 생성하지 않고도 바로 JSON응답이 가능합니다. ', to_date('2023-08-22', 'yyyy-mm-dd'));
insert into tblAnswer values (answer_seq.nextval, 143, 'DI .Dependency Injection) 는 의존성 주입이라고 하여 스프링의 핵심 기능입니다. 약결합을 의미하며 스프링컨테이너가 사용자가 만들어 놓은 빈.업무처리 class)를 손쉽게 받아들이고 생성및 호출  소멸등의 생명주기를 관리하는 편하게 하기위해서 사용한 패턴이라고 생각하시면 됩니다. ', to_date('2023-08-06', 'yyyy-mm-dd'));
insert into tblAnswer values (answer_seq.nextval, 144, 'web browser에서 확인하면 둘다 동일하게 element를 진하게 보여주는 일을 수행합니다. 하지만 두 태그간의 차이는 정말 단순하게 진하게만 보여주는 역할을 합니다. 은 진하게 보여주기도 하지만 페이지내에 중요한 부분을 web browser에 알려주는 역할까지 수행합니다.  ', to_date('2023-08-25', 'yyyy-mm-dd'));
insert into tblAnswer values (answer_seq.nextval, 145, 'Oracle에서 지원하는 대부분의 함수는 PL-SQL에서 사용할 수 있습니다만 질문하신 decode함수는 PL-SQL에서는 처음부터 사용할 수 없는 함수로 설정되어있습니다. 따라서 PL-SQL에서는 decode함수를 사용할 수 있는 방법이 없습니다. ', to_date('2023-08-06', 'yyyy-mm-dd'));
insert into tblAnswer values (answer_seq.nextval, 146, 'JDBC에서 DBMS를 연결하기 위한 Connection String은 DBMS마다 상이합니다. 따라서 연동하고자하는 DBMS의 Connection String을 정확하게 기술하셔서 사용하셔야합니다. 우선 MySql의 Connection String은 jdbc:mysql:--서버ip:3306-db명 입니다.  Oracle은 jdbc:oracle:thin:@서버ip:1521:SID 입니다. . mysql과는 다른 Connection URL을 사용하니 ) ', to_date('2023-08-03', 'yyyy-mm-dd'));
insert into tblAnswer values (answer_seq.nextval, 147, '안녕하세요? Oracle에서 제공하는 SQL문의 종류에는 DCL  DDL  DML이 있습니다. DCL.Data Control Language)에는 commit  rollback  grant  revoke가 있습니다. DDL.Data Definition Language)에는 create  drop  alter  truncate 가 있습니다. DML.Data Manipulation Language)에는 select  insert  update  delete가 있습니다.  ', to_date('2023-07-20', 'yyyy-mm-dd'));
insert into tblAnswer values (answer_seq.nextval, 148, 'java에서 클래스의 종류에는 7가지가 있습니다. class  interface  abstract class  inner class  nested class  local class  anonymous inner class가 제공되고 있습니다. ', to_date('2023-07-01', 'yyyy-mm-dd'));
insert into tblAnswer values (answer_seq.nextval, 149, '첫 번째   오버로딩.overloading)은  한 클래스 안에서 같은 이름의 메소드를 인자값만 다르게 하여 여러개 생성하는 것을 의미합니다. 메소드의 오버로딩시 주의할 사항은  -  메소드의 이름이 같아야 하고  리턴타입은 오버로딩에 큰 영향을 주지 않는다. .리턴타입이 같거나 달라도 상관이 없다는 것입니다.) - 파라미터 갯수가 다르거나  타입이 달라야 한다. ', to_date('2023-06-28', 'yyyy-mm-dd'));
insert into tblAnswer values (answer_seq.nextval, 150, '생성자는 클래스와 같은 이름의 메소드로  새 객체가 생성될 때 호출되는 메소드입니다.. 명시적으로 생성자를 만들지 않아도 JVM 이 기본 생성자를 만들어줍니다. 생성자는 인자값.파라미터)을  다르게 하여 오버로딩.overloading) 할 수 있으며  인자값을 가진 생성자를 오버로딩하여 생성한다면  기본 생성자는 생성되지 않기 때문에 기본 생성자도 함께 명시적으로 정의해 주는 것이 좋습니다. ', to_date('2023-06-17', 'yyyy-mm-dd'));
insert into tblAnswer values (answer_seq.nextval, 151, 'Bootstrap은 웹 페이지 또는 웹 애플리케이션을 구축하기위한 HTML  CSS 및 JavaScript를 포함하는 프레임 워크 또는 도구 세트입니다. 많은 부트 스트랩 구성 요소가 작동하려면 Javascript 플러그인이 필요합니다. ', to_date('2023-06-15', 'yyyy-mm-dd'));
insert into tblAnswer values (answer_seq.nextval, 152, '네 안녕하세요.자바에서 모든 코드는 클래스 안에서 정의되며  그 안에 변수와 메소드를 가집니다. 클래스의 인스턴스를 객체라고 합니다. 클래스는 코드를 모아서 정의한 것일 뿐으로  특정 메모리를 할당받지 않지만  객체는 JVM이 new.)라는 키워드를 인식하여 인스턴스가 생성되는 그 순간  특정 메모리를 할당받아 가지게 됩니다. ', to_date('2023-06-30', 'yyyy-mm-dd'));
insert into tblAnswer values (answer_seq.nextval, 153, '안녕하세요? static import라는것은 import와는 다르게 class안에 존재하는 static 변수나 method사용하기 위해서 만들어진 import 구문 입니다. 예를 들면java.lang.Integer 클래스가 있습니다. 그 안에는 MAX_VALUE라는 constant와 parseInt method가 있습니다. 그것을 사용하는 것으로 예를 들어드리면 상수와 method를 사용하는 클래스에서 import static java.lang.Integer.MAX_VALUE; 를 선언하면 Integer.MAX_VALUE 이런식의 문장을 써야하는 상황에서  간편하게 클래스 없이 MAX_VALUE 만 써도 얼마든지 사용할 수 있게됩니다. ', to_date('2023-05-30', 'yyyy-mm-dd'));
insert into tblAnswer values (answer_seq.nextval, 155, 'Amazon Relational Database Service .RDS) 클라우드 서버에서 관계형 데이터베이스를 설정  운영 및 확장하는 관리 형 서비스입니다. 관계 데이터베이스 서비스에는 클라우드 고객이 데이터베이스로 선택할 수있는 데이터베이스 엔진으로 Aurora  PostgreSQL  MySQL  Oracle  SQL Server 및 MariaDB가 있습니다. RDS는 또한 기존 데이터베이스를 Amazon RDS로 마이그레이션하고 복제하는 AWS 데이터베이스 마이그레이션 서비스를 제공합니다. ', to_date('2023-06-14', 'yyyy-mm-dd'));
